INSERT INTO `SkiBoards` (`skiboard_id`, `url`, `brand`, `model`, `year`, `name`, `slug`, `category`, `family`, `description`, `stiffness`, `shape`, `flex_profile`, `camber_profile`, `camber_details`, `core`, `core_profiling`, `fibreglass`, `laminates`, `resin`, `base`, `edges`, `edge_tech`, `topsheet`, `sidewall`, `inserts`, `asym`, `weight`, `womens`, `youth`, `created`, `updated`) VALUES
(1, '', 'Burton', 'Custom', '2020', 'Burton Custom 2020', 'burton-custom-2020', 'Snowboard', '', 'There are many imitators, but the Burton Custom Snowboard is the original beast of many burdens. Accept no substitute, the Custom has been evolving towards versatile perfection since 1996. Maybe you have seen a few of them out there, blasting down groomers, popping high into the air effortlessly, and still out there shredding the resort when the brights come on. Poppy, fast, responsive, and powerful, there are no signs that the legend of the Burton Custom Snowboard will ever slow down.', 6, 'Directional Twin', 'Twin', 'Full Camber', NULL, 'Super Fly II 700G Core', NULL, NULL, '45 Carbon Highlights', 'Super Sap Epoxy', 'Sintered WFO Base', NULL, NULL, NULL, NULL, 'channel', NULL, NULL, NULL, 0, '2024-01-22 20:08:15', '2024-01-22 20:08:15'),
(17, '', 'Burton', 'Mystery Landlord', '2020', 'Burton Mystery Landlord 2020', 'burton-mystery-landlord-2020', 'Snowboard', 'Family Tree', 'Is there anything in life better than a landlord shrouded in mystery? When rent is paid by having yourself a wild time on the mountain, definitely not. The Burton Family Tree Mystery Landlord Snowboard appreciates your patronage and as a token of friendship offers Burton`s top of the line technologies - a Methlon base with a serious need for speed, a light and powerful Mystery Glass layup with secret design details, and a directional camber design that rewards the brave with elite control on all sorts of terrain, inbounds or out.', 6, 'Directional', 'Directional', 'Directional Camber', '', 'FSC Certified Dragonfly II 500G Core', NULL, 'Mystery Glass', '', 'Super Sap Epoxy', 'Methlon Base', NULL, NULL, NULL, NULL, 'channel', NULL, 0, NULL, 0, '2024-02-06 08:26:24', '2024-02-06 08:26:24'),
(19, '', 'Burton', 'Moon Buggy', '2020', 'Burton Moon Buggy 2020', 'burton-moon-buggy-2020', 'Snowboard', 'Family Tree', 'Buck the short`n`wide pow board trend and get weightless on the Burton Family Tree Moon Buggy Snowboard. For spaceman surfers looking to throw up comet tails of cold smoke, this rocketship is ready for liftoff. From its huge surface area to the internal swallowtail, this is the wave motion gun for blasting on the deepest of days. Go lunar.', 6, 'Directional', 'Directional', 'Directional Camber', '', 'FSC Certified Dragonfly 600G Core', NULL, NULL, '45 Carbon Highlights', 'Super Sap Epoxy', 'Recycled Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, NULL, 0, '2024-02-06 18:22:51', '2024-02-06 18:22:51'),
(20, '', 'Burton', 'Hometown Hero', '2020', 'Burton Hometown Hero 2020', 'burton-hometown-hero-2020', 'Snowboard', 'Family Tree', 'The Burton Family Tree Hometown Hero Snowboard is the choice of superlocals, hidden stashers, and all-season slashers. Designed to blast through bunk and lay waste to chunk on its way to the holy land of deep funk, the FTHH is an all-around ripper`s ride. Directional, pretty stiff traditional camber, and a tapered blunt shape all work with a lightweight carbon-boosted core to make for a board that`s, quite frankly, very exciting. You`re not going to achieve hero status by dinking around: get charging!', 6, 'Directional', 'Directional', 'Directional Camber', '', 'Super Fly II 700G Core', NULL, NULL, '45 Carbon Highlights', 'Super Sap Epoxy', 'Recycled Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, NULL, 0, '2024-02-06 18:34:39', '2024-02-06 18:34:39'),
(21, '', 'Burton', 'Leader Board', '2020', 'Burton Leader Board 2020', 'burton-leader-board-2020', 'Snowboard', 'Family Tree', 'Made to excel on the Freeride World Tour, the Burton Family Tree Leader Board Snowboard brings confidence and stability to sketchy situations. From the slightly spooned nose to minimize edge catch in no-fall zones, to the aggressive flex that`ll hold on when the snow doesn`t, to a perfect taper that keeps the nose up without turning this board into a whimsical wiggler: the Leader Board is the one you want under your feet when the going gets marginal. This one`s high strung and responsive because it has to be.', 8, 'Directional', 'Directional', 'Directional Camber', '', 'Super Fly II 700G Core', NULL, NULL, 'Carbon I-Beam', 'Super Sap Epoxy', 'Recycled Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, NULL, 0, '2024-02-06 18:40:18', '2024-02-06 18:40:18'),
(22, '', 'Burton', 'One Hitter', '2020', 'Burton One Hitter 2020', 'burton-one-hitter-2020', 'Snowboard', 'Family Tree', 'Ride the way you`ve always wanted on the Burton Family Tree One Hitter Snowboard. This board turns to speed up, carving across the hill to squeeze out one more side hit while the boring riders are sliding like statues down the middle of the run. Edge hold, pop, and oodles of style: the One Hitter is always ready for those last-second decisions. Live a little, why don`t ya!', 7, 'Directional', 'Directional', 'Directional Camber', '', 'Super Fly II 700G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Recycled Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, NULL, 0, '2024-02-07 02:28:46', '2024-02-07 02:28:46'),
(23, '', 'Burton', 'Backseat Driver', '2020', 'Burton Backseat Driver 2020', 'burton-backseat-driver-2020', 'Pow Surf', 'Family Tree', 'Free your feet, free you mind  true snowboard construction built to surf on snow. Surf-inspired design meets traditional snowboard construction in the men`s Burton Backseat Driver Snowboard. If you`re wondering, `Where do the bindings go?` They don`t. This pow surfer is designed to surf sans-straps everywhere from your backyard to the backcountry. A spoon nose provides float and flow, working in conjunction with a V-hull in the tail that maintains a loose feeling, but transitions into a strong, powerful turn when engaged. This board is built to push boundaries, and spread the joy of surfing on snow.', 4, 'Directional', 'Directional', 'Directional Flat', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded Base', NULL, NULL, NULL, NULL, 'channel', NULL, 0, NULL, 0, '2024-02-07 02:33:20', '2024-02-07 02:33:20'),
(24, '', 'Burton', 'Stick Shift', '2020', 'Burton Stick Shift 2020', 'burton-stick-shift-2020', 'Snowboard', 'Family Tree', 'Pop the clutch and smoke the tires! The Burton Family Tree Stick Shift Snowboard is like a two door rally car, capable of making tight turns and huge smiles. Faster than you`d think, it floats like a dream and rips soft snow like few other boards can, agile and always playful. It`s probably not going to be your favorite board in the park, but it handles the groomers to and from the deep stuff very well too. This is what snowboarding`s all about.', 5.5, 'Directional', 'Directional', 'Directional Flat', '', 'Super Fly II 700G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Recycled Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 0, '2024-02-07 02:53:48', '2024-02-07 02:53:48'),
(25, '', 'Burton', 'Flight Attendant Split', '2020', 'Burton Flight Attendant Split 2020', 'burton-flight-attendant-split-2020', 'Splitboard', '', 'Sure, you could take a chainsaw to your old beater board and make your own splitty, or you could skip all that and pick up the Burton Flight Attendant Splitboard so you can have fun right away. Its directional camber profile has rocker in the nose to help you surf the soft stuff with camber behind it to let you load up power and have reliable control on the descent. Triax glass and carbon reinforcement gives the Burton Flight Attendant Splitboard the torsional rigidity and lightness combo that splitboarders crave and appreciate, both going up and going down.', 6, 'Directional', 'Directional', 'Directional Camber', '', 'Super Fly II 700G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 02:57:40', '2024-02-07 02:57:40'),
(26, '', 'Burton', 'Flight Attendant X Split', '2020', 'Burton Flight Attendant X Split 2020', 'burton-flight-attendant-x-split-2020', 'Splitboard', 'Family Tree', 'When it comes to splitboarding, your board`s weight becomes even more important. The Burton Family Tree Flight Attendant X Splitboard uses an ultralight Dragonfly core and super-secret Mystery glass, making each step towards the promised land that much easier--something that gram-counting backcountry travelers will love. But this board isn`t all about the skintrack, it`s a snowboard first and foremost. When it`s time to drop into the feature you woke up at 4am to reach, the FA X Split is responsive, fast, floaty, and fun. This board is tippy top tech from Burton.', 7, 'Directional', 'Directional', 'Directional Camber', '', 'Dragonfly 600G Core', NULL, 'Mystery Glass', '', 'Super Sap Epoxy', 'Methlon', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 03:00:03', '2024-02-07 03:00:03'),
(27, '', 'Burton', 'Storyboard', '2020', 'Burton Storyboard 2020', 'burton-storyboard-2020', 'Snowboard', 'Family Tree', 'Map out your bestseller on the fantastic Burton Family Tree Story Board Snowboard, a freeride deck that embraces surprise plot twists. High-end materials and killer construction meet a shape and flex profile that, while easy to ride, can instantly turn it up to page-turner status. Bolstered by a carbon I-Beam and triaxial glass, the ultralight core gives this board a vitality and float that`s exhilarating.', 6, 'Directional', 'Directional', 'Directional Camber', '', 'Super Fly II 700G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 0, '2024-02-07 03:03:38', '2024-02-07 03:03:38'),
(28, '', 'Burton', 'Anti-Social Split', '2020', 'Burton Anti-social Split 2020', 'burton-anti-social-split-2020', 'Splitboard', 'Family Tree', 'It might be called the Anti-Social, but we bet everybody will want to be your friend so they can try your Burton Family Tree Anti-Social Splitboard. A premium splitty designed to tackle unclaimed lines, this women`s specific backcountry vehicle is at home trekking uphill, ripping down hill, and surfing the finest terrain with authority. Its directional camber profile keeps the nose higher up in the soft stuff while the camber zone lets you put down some quality power and response when the conditions demand it.', 6, 'Directional', 'Directional', 'Directional Camber', '', 'Super Fly II 700G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 0, '2024-02-07 03:07:12', '2024-02-07 03:07:12'),
(29, '', 'Burton', 'Instigator', '2020', 'Burton Instigator 2020', 'burton-instigator-2020', 'Snowboard', '', 'Maybe you`ve heard the news that snowboarding can be a couple days of falling before you get settled in with the whole sliding sideways down the mountain thing. The Burton Instigator Snowboard is designed to help mitigate the learning curve. A soft forgiving flex and a durable extruded base give you room to play without worrying about your board treating you unfairly. It`s a fun, forgiving ride that you can take all over the mountain. Get things started with the Burton Instigator Snowboard and start thinking about which season pass you want!', 4, 'Directional', 'Twin', 'Hybrid Flat', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 03:49:28', '2024-02-07 03:49:28'),
(30, '', 'Burton', 'Ripcord', '2020', 'Burton Ripcord 2020', 'burton-ripcord-2020', 'Snowboard', '', 'Let it rip this season on the Burton Ripcord Snowboard. Easy-ridin` and progression-friendly, you can develop your skills with confidence knowing that the board beneath your feet is designed to help you refine your abilities and mitigate some of the early challenges of learning to do something as silly and fun as strapping your feet to a plank of wood and riding down a big slippery hill. Get on your Burton Ripcord Snowboard and make friends with the mountain!', 3, 'Directional', 'Directional', 'Hybrid Flat', '', 'Fly 900G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 04:06:58', '2024-02-07 04:06:58'),
(31, '', 'Burton', 'Descendant', '2020', 'Burton Descendant 2020', 'burton-descendant-2020', 'Snowboard', '', 'The Burton Descendant Snowboard is the park and all-mountain plank for the boarder that understands the value of versatility all over the resort. A true twin that handles just as well riding switch as it does in your normal stance, impress the chairlift with your confident landing gear thanks to the supple and damp Squeezebox Low construction and a softer flex that`s forgiving and fun.', 4, 'Twin', 'Twin', 'Hybrid Camber', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 04:10:17', '2024-02-07 04:10:17'),
(32, '', 'Burton', 'Stylus', '2020', 'Burton Stylus 2020', 'burton-stylus-2020', 'Snowboard', '', 'Set yourself up for a successful start to your snowboarding skill development by getting yourself a board made to work with you, not against you. The Burton Stylus Snowboard is full of beginner-friendly features like a flat bottom profile with Burton`s Easy Bevel, a technology that smooths out turns by making it difficult to catch an edge so you can learn to intuitively control your snowboard. Where will you go next on your Burton Stylus Snowboard?', 3, 'Twin', 'Twin', 'Hybrid Flat', '', 'Fly 900G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 0, '2024-02-07 04:23:36', '2024-02-07 04:23:36'),
(33, '', 'Burton', 'Hideaway', '2020', 'Burton Hideaway 2020', 'burton-hideaway-2020', 'Snowboard', '', 'The Burton Hideaway Snowboard inspires confidence with forgiving characteristics and easy handling that make it great as a learning board, or as a friendly, playful setup for shredding groomers and the whole mountain. A flat board profile between your feet offers excellent stability without catchiness and handles all conditions with a predictable good nature. Hop on the Burton Hideaway Snowboard and get your next snowboarding adventure started.', 4, 'Directional', 'Twin', 'Hybrid Flat', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 0, '2024-02-07 04:28:43', '2024-02-07 04:28:43'),
(34, '', 'Burton', 'Paramount', '2020', 'Burton Paramount 2020', 'burton-paramount-2020', 'Snowboard', '', 'The park won`t know what hit it when you attack mega features with the Burton Paramount Snowboard. This powerful and playful true twin features a responsive flex for jibbing goodness in a design that accomplishes great things all over the mountain. The Burton Paramount Snowboard has Frostbite Edges for powerful edge grip and stability even when conditions are like frozen concrete.', 6, 'Twin', 'Twin', 'Full Camber', '', 'Super Fly II 700G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 04:33:14', '2024-02-07 04:33:14'),
(35, '', 'Burton', 'Kilroy 3D', '2020', 'Burton Kilroy 3D 2020', 'burton-kilroy-3d-2020', 'Snowboard', '', 'Burton is never satisfied, that`s why they innovate new features to push the sport of snowboarding to new heights. The latest evolution to come out of the design lab is the Burton Kilroy 3D Snowboard, the best thing to happen to park snowboarding since that time you almost bailed on a monster booter but stuck it instead and everyone saw. Three-dimensional contours at the nose and tail reduce catchiness for smooth-flexing butters and presses like no other, so you can get a little wild and know that your board is made to play. In case you hadn`t noticed, the ground is contoured, and now you`ve got a snowboard to match the shape of the planet you ride on.', 5, 'Twin', 'Twin', 'Hybrid Camber', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 04:37:16', '2024-02-07 04:37:16'),
(36, '', 'Burton', 'Kilroy Twin', '2020', 'Burton Kilroy Twin 2020', 'burton-kilroy-twin-2020', 'Snowboard', '', 'Boarders of all abilities, rejoice. Unify with the other knights of radness and storm the mountain on the Burton Kilroy Twin Snowboard. The Kilroy Twin thrives in the park, rips down the groomers, and might only make you hungrier for more riding after each lap. A responsive and poppy camber profile loves to be loaded up and to lay a carve, while the friendly construction of the Burton Kilroy Twin Snowboard appeals to riders who love to work on their skill progression and surf all terrain. Thanks to its speedy base, you can leave your foot on the throttle and keep the thrills coming until you can`t handle any more fun.', 4, 'Twin', 'Twin', 'Full Camber', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 04:40:42', '2024-02-07 04:40:42'),
(37, '', 'Burton', 'Name Dropper', '2020', 'Burton Name Dropper 2020', 'burton-name-dropper-2020', 'Snowboard', '', 'Let your riding speak for itself with the Name Droppers next-generation, park-tuned performance. Off-Axis means all of its key ingredients, from the edges to the poppy core profile, match the angles of your stance for enhanced grip, smoother takeoffs, and stomped landings. PurePop Camber amplifies ollies and loosens up the overall feel for a more playful take on traditional camber, while the addition of effortlessly flexing Off-Axis Squeezebox Low enhances the overall soft freestyle feel.', 4, 'Twin', 'Asym Twin', 'Hybrid Camber', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 04:48:41', '2024-02-07 04:48:41'),
(38, '', 'Burton', 'Rewind', '2020', 'Burton Rewind 2020', 'burton-rewind-2020', 'Snowboard', '', 'The Burton Rewind Snowboard is so capable you might do a double take. No, it`s not an illusion, this playful park and groomer board can charge hard, do laps in the park, or just cruise the whole mountain with confidence. This true twin rides the same forwards and backwards so you can practice switch landings and spin tricks or put in time on mixing up your technique. Don`t forget to have your friends hit record so you can play back your Burton Rewind Snowboard laps on the big screen when you get home.', 4, 'Twin', 'Asym Twin', 'Hybrid Camber', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 0, '2024-02-07 04:50:33', '2024-02-07 04:50:33'),
(39, '', 'Burton', 'Yeasayer (Flat Top)', '2020', 'Burton Yeasayer (Flat Top) 2020', 'burton-yeasayer-flat-top-2020', 'Snowboard', '', 'If you`re ready to up your snowboarding game and add some sizzle to those bacon-good lines you`re cooking up, just say `yes` to the Burton Yeasayer Snowboard. This shred-everything true twin features Burton`s Flat Top profile for float and predictability with a durable extruded base that is both fast and well-prepared for daily laps. Innovative shaping provides float through all types of snow, a catch-free ride, and traction even when things get dicey.', 3, 'Twin', 'Twin', 'Hybrid Flat', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 0, '2024-02-07 05:03:12', '2024-02-07 05:03:12'),
(40, '', 'Burton', 'Yeasayer (Flying V)', '2020', 'Burton Yeasayer (Flying V) 2020', 'burton-yeasayer-flying-v-2020', 'Snowboard', '', 'If you`re ready to up your snowboarding game and add some sizzle to those bacon-good lines you`re cooking up, just say `yes` to the Burton Yeasayer Flying V Snowboard. This shred-everything true twin features Burton`s Flying V hybrid camber profile for the unreal blend of float and bite true all-terrain riders crave with a durable extruded base that is both fast and well-prepared for daily laps. Innovative shaping provides float through all types of snow, a catch-free ride, and traction even when things get dicey.', 3, 'Twin', 'Twin', 'Hybrid Rocker', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 0, '2024-02-07 05:04:41', '2024-02-07 05:04:41'),
(41, '', 'Burton', 'Free Thinker', '2020', 'Burton Free Thinker 2020', 'burton-free-thinker-2020', 'Snowboard', '', 'It`s not like you`re about to rip that ridiculously good fresh snow on a park noodle. And, yes, that is Keith Haring art gracing this board. The Burton Free Thinker Snowboard is the thinking man`s snowboard, if by thinking you mean all-terrain ride-everything ripping. This shreddy twin mashes in both directions, with a camber and carbon construction for excellent power and pop to send you huge off booters and course correct in a hurry when you reconnect with that thing beneath you called the ground.', 6.5, 'Twin', 'Twin', 'Full Camber', '', 'Super Fly II 700G Core', NULL, NULL, '45 Carbon Highlights', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 05:06:49', '2024-02-07 05:06:49'),
(42, '', 'Burton', 'Talent Scout', '2020', 'Burton Talent Scout 2020', 'burton-talent-scout-2020', 'Snowboard', '', 'The Burton Talent Scout Snowboard is a proper cambered twin board for shredders who crave modern performance in a refined, traditional shape that has been ruling the slopes for years and for good reason. Camber is poppy and responsive, a twin shape is fun all over the mountain and versatile to ride, and a sintered base is speedy for maximum thrills. Frostbite Edges allow the Burton Talent Scout Snowboard to grip even in icy conditions, so you can forget about the forecast and just ride.', 6, 'Twin', 'Asym Twin', 'Full Camber', '', 'Super Fly II 700G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered', NULL, NULL, NULL, NULL, 'channel', 0, 0, 1, 0, '2024-02-07 05:10:29', '2024-02-07 05:10:29'),
(43, '', 'Burton', 'Process', '2020', 'Burton Process 2020', 'burton-process-2020', 'Snowboard', '', 'Snowboarding is about evolution. Trust the Process and you shall be rewarded. The big scoop nose and tail on the Burton Process Snowboard make it easy to trust in all conditions, providing excellent float in soft stuff and a catch-free ride all over the resort. The Burton Process Snowboard is the ultimate groomer board, with Frostbite Edges to improve traction on hardpack, a versatile twin shape and flex for reliable handling riding switch and acing your way through the park, and a light, friendly design for a ride that`s just as inviting on the last lap of the day as it is on the first.', 5, 'Twin', 'Twin', 'Hybrid Camber', '', 'Super Fly II 700G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 05:14:19', '2024-02-07 05:14:19'),
(44, '', 'Burton', 'Process (Flying V)', '2020', 'Burton Process (Flying V) 2020', 'burton-process-flying-v-2020', 'Snowboard', '', 'Why shred in one direction when you can shred in both? The true twin Burton Process Flying V Snowboard has a speedy sintered base with a playful Triax fiberglass layup for maneuverability and versatility through the park, down the groomers, and everywhere else you decide to take this many-trick pony. If you happen to run into Mark McMorris, you can break the ice over how much you love the Burton Process Flying V Snowboard.', 5, 'Twin', 'Twin', 'Hybrid Rocker', '', 'Super Fly II 700G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 05:15:52', '2024-02-07 05:15:52'),
(45, '', 'Burton', 'Custom (Flying V)', '2020', 'Burton Custom (Flying V) 2020', 'burton-custom-flying-v-2020', 'Snowboard', '', 'For elite snowboarding, you need an elite snowboard. The Burton Custom Flying V Snowboard is top-shelf, built with a premium FSC Certified Super Fly II 700G Core with carbon reinforcements for a powerful ride that others can only try to imitate. Burton`s unique Flying V hybrid camber profile blends the best of both worlds, with alternating rocker and camber zones for the versatility to surf through soft snow, bite on hardpack, and win the standoff with scary terrain.', 6, 'Directional Twin', 'Twin', 'Hybrid Rocker', '', 'Super Fly II 700G Core', NULL, NULL, '45 Carbon Highlights', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 05:18:41', '2024-02-07 05:18:41'),
(47, '', 'Burton', 'Custom X', '2020', 'Burton Custom X 2020', 'burton-custom-x-2020', 'Snowboard', '', 'If your snowboard doesn`t have an X in its name, is it really good enough for high-level shredding all over the mountain? The Burton Custom X Snowboard has the name, the pedigree, and the design to give you the results. Burton calls this board `pro-caliber`, and there isn`t any mystery why. Carbon reinforcements, pure and precise camber, and a speedy sintered base are just a few of the elements that combine to make this snappy Squeezebox deck a poppy thing of beauty that is sought after by aggressive riders when the best is required.', 7, 'Directional Twin', 'Twin', 'Full Camber', '', 'Dragonfly 600G Core', NULL, NULL, '45 Carbon Highlights', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 05:21:45', '2024-02-07 05:21:45'),
(48, '', 'Burton', 'Custom X (Flying V)', '2020', 'Burton Custom X (Flying V) 2020', 'burton-custom-x-flying-v-2020', 'Snowboard', '', 'Deep in a secret mountain headquarters, the big brained boarders at Burton are hard at work. They`re experimenting day and night. In their lab coats, staring at bubbling beakers while one of those lightning bolt balls makes zappy noises in the background. The Burton Custom X Flying V Snowboard is the kind of thing they`re pumping out: high end no-holds-barred snow tech for our planet`s most demanding riders. Strap one on and begin the launch sequence!', 7, 'Directional Twin', 'Twin', 'Hybrid Rocker', '', 'Dragonfly 600G Core', NULL, NULL, '45 Carbon Highlights', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 05:24:55', '2024-02-07 05:24:55'),
(49, '', 'Burton', 'Feelgood', '2020', 'Burton Feelgood 2020', 'burton-feelgood-2020', 'Snowboard', '', 'Snowboarding is supposed to make you feel stoked, rad, fired up, and confident that you can leave it all on the mountain after every lap. The Burton Feelgood Snowboard is as it sounds and a Kelly Clark favorite for good reason. A fully-cambered and fully-loaded carver and all-mountain machine, think of the Burton Feelgood Snowboard as a wood and carbon exotic car with the handling performance to match the horsepower. When its icy out, the Frostbite Edges help improve traction through the dicey spots so you can shred through all conditions.', 6, 'Directional Twin', 'Twin', 'Full Camber', '', 'Super Fly II 700G Core', NULL, NULL, '45 Carbon Highlights', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 0, '2024-02-07 05:30:41', '2024-02-07 05:30:41'),
(50, '', 'Burton', 'Feelgood (Flying V)', '2020', 'Burton Feelgood (Flying V) 2020', 'burton-feelgood-flying-v-2020', 'Snowboard', '', 'If you don`t love attacking the mountain and riding in tune with gravity on the Burton Feelgood Flying V Snowboard, snowboarding might just not be for you. Its women`s specific layup with Carbon I-Beam power for an aggressive and responsive ride gives the confidence and poise that proper all-terrain shredding requires, with Burton`s versatile Flying V hybrid camber profile to help you get the most out of the board in any snow. All this is mated to a super fast Sintered WFO base so you can put your foot on the gas and have fun at top speeds!', 6, 'Directional Twin', 'Twin', 'Hybrid Rocker', '', 'Super Fly II 700G Core', NULL, NULL, '45 Carbon Highlights', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 0, '2024-02-07 05:32:17', '2024-02-07 05:32:17'),
(51, '', 'Burton', 'Kilroy Directional', '2020', 'Burton Kilroy Directional 2020', 'burton-kilroy-directional-2020', 'Snowboard', '', 'The pointy end goes down the hill. The Burton Kilroy Directional Snowboard is an all-terrain, all-mountain board, for sure. But there`s more to it than that. A twin flex gives a predictable ride more balanced than a circus clown on a tightrope so you can huck without wondering what the landing will be like and ride with supreme confidence in the stability of your board. Squeezebox Low core-profiling technology gives a smooth and friendly flex without gimmicks. The Burton Kilroy Directional Snowboard is all about shredding everything and capturing the playful feelings that make snowboarding what it is.', 5, 'Directional', 'Twin', 'Full Camber', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 05:35:51', '2024-02-07 05:35:51'),
(52, '', 'Burton', 'Flight Attendant', '2020', 'Burton Flight Attendant 2020', 'burton-flight-attendant-2020', 'Snowboard', '', 'We`re now boarding. All zones. The Burton Flight Attendant Snowboard is a first-class ride made to carve. Its blunted shape has a slight taper to make it quickly dip into turns, and a 35mm setback creates that lift you need when you make it to the clouds. The Flight Attendant can handle turbulence with a pretty aggressive flex, and, as its name suggests, is very well-suited to soaring off natural hits. A big mountain blazer of a board, this one`s non-stop.', 6.5, 'Directional', 'Twin', 'Directional Camber', '', 'Super Fly II 700G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 05:37:58', '2024-02-07 05:37:58'),
(53, '', 'Burton', 'Deep Thinker', '2020', 'Burton Deep Thinker 2020', 'burton-deep-thinker-2020', 'Snowboard', '', 'When Danny Davis takes to the hill on a pow day, he`s grabbing his Burton Deep Thinker Snowboard and not returning to the car until the lifts stop spinning. This board is slightly tapered, extremely poppy, and very lively overall, making it a blast to ride on everything you`ll encounter on a great day of riding. The profile is camber-dominant with a floaty nose. This means big boosts and roosts in deeper snow, but with enough switch-capability to facilitate hardpack fun. With Keith Haring art, the Deep Thinker is all about maximum creativity.', 7, 'Directional', 'Directional', 'Directional Camber', '', 'Super Fly II 700G Core', NULL, NULL, '45 Carbon Highlights', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 05:41:48', '2024-02-07 05:41:48'),
(54, '', 'Burton', 'Skeleton Key', '2020', 'Burton Skeleton Key 2020', 'burton-skeleton-key-2020', 'Snowboard', '', 'How do you unlock the secret to shredding whatever terrain gets put in front of you? The Burton Skeleton Key Snowboard is a good start, with a freeride-friendly directional camber profile that has rocker in the nose for extra float in the soft stuff and camber behind it to help you drive epic carves slash the mountain until your feet fall off. Its super-fast Sintered WFO base loves to have a lead foot on the gas pedal so you can full-throttle send it like you`ve got a canyon to clear. The Burton Skeleton Key Snowboard is so good at taking advantage of the whole mountain that it`s almost like cheating.', 5.5, 'Directional', 'Directional', 'Directional Camber', '', 'Super Fly II 700G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 05:43:38', '2024-02-07 05:43:38'),
(55, '', 'Burton', 'Day Trader', '2020', 'Burton Day Trader 2020', 'burton-day-trader-2020', 'Snowboard', '', 'The Burton Day Trader Snowboard is all about the swoops--the lefts, the rights, and every combination thereof. This board will go in a straight line, sure, but what`s the point in that?--as soon as you strap into this playful directional board you`ll be obsessed with putting curvy tracks in unique and undiscovered places. Whether you`re feeling squirrel-levels of hyperactivity or soaring eagle spirals, there`s an arc out there that this board is just itching to make.', 5, 'Directional', 'Directional', 'Directional Flat', '', 'Super Fly II 700G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 0, '2024-02-07 05:44:49', '2024-02-07 05:44:49'),
(56, '', 'Burton', 'Role Model', '2020', 'Burton Role Model 2020', 'burton-role-model-2020', 'Snowboard', 'Family Tree', 'Bittersweet news, folks: this is the board they`ll be riding when they finally leave you behind. The Burton Family Tree Role Model Snowboard is for little rippers on big mountains. If their riding has adults looking up to them for tips and inspiration, this is the freeride board for them. Laid up with triaxial glass and a poppy Super Fly wood core, this board reacts instantly to their synapse-frying decisions. It`s setback and tapered, but has a twin flex for switch riding if the situation calls for it. Set it up and set them free!', 5, 'Directional', 'Twin', 'Directional Camber', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Sintered WFO', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 1, '2024-02-07 05:47:08', '2024-02-07 05:47:08'),
(57, '', 'Burton', 'Custom Smalls', '2020', 'Burton Custom Smalls 2020', 'burton-custom-smalls-2020', 'Snowboard', '', 'An all-around board for younger rippers who really do ride all around, the Burton Custom Smalls Snowboard has a lot to live up to. Sporting the name of one of the most versatile and storied boards in history, this is a twin park board that can ride pow, a high-speed carver that`s still maneuverable, and a well-made plank qualified to be a Burton Custom. Its lightweight wood core, symmetrical twin shape and flex, and poppy traditional camber make it a solid choice for the next wave of supergroms.', 5, 'Twin', 'Twin', 'Hybrid Camber', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 1, '2024-02-07 05:48:43', '2024-02-07 05:48:43'),
(58, '', 'Burton', 'Feelgood Smalls', '2020', 'Burton Feelgood Smalls 2020', 'burton-feelgood-smalls-2020', 'Snowboard', '', 'An all-around board for younger rippers who really do ride all around, the Burton Feelgood Smalls Snowboard has a lot to live up to. This is a twin park board that can ride pow, a high-speed carver that`s still maneuverable, and a well-made plank qualified to be a Burton staple. Its lightweight wood core, symmetrical twin shape and flex, and poppy traditional camber make it a solid choice for the next wave of supergroms.', 5, 'Twin', 'Twin', 'Hybrid Camber', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 1, '2024-02-07 05:49:39', '2024-02-07 05:49:39'),
(59, '', 'Burton', 'Process Smalls', '2020', 'Burton Process Smalls 2020', 'burton-process-smalls-2020', 'Snowboard', '', 'A playful and versatile board for the rapidly progressing tweener, the Burton Process Smalls Snowboard goes big with the board tech - a Super Fly core, Pro-Tip shaping and the stable, easy-riding Flat Top rocker profile make the Process Smalls an absolute beast of a board all over the mountain.', 4, 'Twin', 'Twin', 'Hybrid Flat', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 1, '2024-02-07 05:50:50', '2024-02-07 05:50:50'),
(60, '', 'Burton', 'Yeasayer Smalls', '2020', 'Burton Yeasayer Smalls 2020', 'burton-yeasayer-smalls-2020', 'Snowboard', '', 'A playful and versatile board for the rapidly progressing tweener, the Burton Yeasayer Smalls Snowboard goes big with the board tech - a Super Fly core, Pro-Tip shaping and the stable, easy-riding Flat Top rocker profile make the Process Smalls an absolute beast of a board all over the mountain.', 4, 'Twin', 'Twin', 'Hybrid Flat', '', 'Super Fly 800G Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 1, '2024-02-07 05:52:06', '2024-02-07 05:52:06'),
(61, '', 'Burton', 'Chopper', '2020', 'Burton Chopper 2020', 'burton-chopper-2020', 'Snowboard', '', 'The Burton Chopper Snowboard hasn`t changed much over the years, and it doesn`t need to. The first board of many contemporary greats, the Chopper features a soft and forgiving flex with Biax glass and a Flat Top, Easy Bevel design that leaves the base of the board slightly higher than the edges and makes it almost impossible to catch an edge. The Burton Chopper is the right board for introducing your young ripper to the joys of the sport.', 2, 'Twin', 'Twin', 'Hybrid Flat', '', 'Fly Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 0, 1, '2024-02-07 05:54:48', '2024-02-07 05:54:48'),
(62, '', 'Burton', 'Chicklet', '2020', 'Burton Chicklet 2020', 'burton-chicklet-2020', 'Snowboard', '', 'The Burton Chicklet is the ticket for girls who want to start snowboarding and quickly learn the basics. What makes it so perfect is the beginner-friendly combo of a convex base with upturned edges and the softest flex possible so that even the lightest weight riders can master turning and stopping. The catch-free feeling continues with a flat profile from nose to tail thats extra stable for better balance and board control. Attach the Riglet accessory to the nose or tail of the 80-120cm sizes to tow her around and get her comfortable until she`s ready to add bindings.', 2, 'Twin', 'Twin', 'Hybrid Flat', '', 'Fly Core', NULL, NULL, '', 'Super Sap Epoxy', 'Extruded', NULL, NULL, NULL, NULL, 'channel', NULL, 0, 1, 1, '2024-02-07 05:56:17', '2024-02-07 05:56:17'),
(63, '', 'CAPiTA', 'DOA', '2020', 'Capita DOA 2020', 'capita-doa-2020', 'Snowboard', '', 'For glory, and for the sake of good snowboarding! When legions of dedicated all-terrain warriors need one board to do it all, they reach for the unstoppable CAPiTA Defenders of Awesome Snowboard and its legendary go-everywhere, huck-everything personality. Between the epic base and topsheet graphics are some of the industry`s finest technologies, like a poppy and light FSC Certified Dual Core backed by carbon fiber beams for power, response and playfulness. Grab your CAPiTA Defenders of Awesome Snowboard and get on the chairlift, we`ve got awesome to defend.', 5.5, 'Twin', 'Twin', 'Hybrid Camber', 'Resort V1', 'FSC Certified Dual Core', NULL, 'Special Blend Biax/Biax Fibreglass', 'Carbon Fiber Beams', 'Magic Bean Resin', 'Quantum Drive Base', NULL, NULL, NULL, 'Full ABS1000 Fortress Kevlar Bound Sidewalls', '4x4', NULL, 0, 0, 0, '2024-02-19 06:43:28', '2024-02-19 06:43:28'),
(64, '', 'CAPiTA', 'NEO Slasher', '2020', 'Capita Neo Slasher 2020', 'capita-neo-slasher-2020', 'Splitboard', '', 'Adventure is yours if you`re ready to put in a little work to get your fresh tracks. The CAPiTA NEO Slasher Splitboard is the powder-thirsty carbon-infused splitty that dreams are made of, crafted for human-powered fresh tracks and out-there moments that make you go, `woah, dude`--- and for the sickest performance up and down the hill. Its sintered Hyperdrive Base hates to waste snow and gravity, with special additives that make this base one for the ages. You already know what the resort dinners cost, but you can`t put a price on a full plate of untouched powder bowls with the crew. Bon appetit, the CAPiTA NEO Slasher Splitboard aims to please you and your taste for endless grown-man fun beyond the boundary gates.', 7, 'Directional', 'Directional', 'Directional Hybrid Camber', 'Alpine V2', 'FSC Certified Elevate Split Core', NULL, 'Holysheet Triax/Triax Fibreglass', 'Carbon Fiber Beams', 'Magic Bean Resin', 'Hyperdrive Base', NULL, NULL, NULL, 'Full ABS1000 Sidewalls', '4x2', NULL, 0, 0, 0, '2024-02-19 07:15:37', '2024-02-19 07:15:37'),
(65, '', 'CAPiTA', 'Black Snowboard of Death', '2020', 'Capita Black Snowboard of Death 2020', 'capita-black-snowboard-of-death-2020', 'Snowboard', '', 'Drop in or get out of the way, that CAPiTA The Black Snowboard of Death Snowboard isn`t waiting around. This directional all-terrain technician is a legend for a reason, capable of ripping an unreal line down steep and spiny terrain, a confidence-inspiring board with poise and epic pace. A setback riding position and carbon/wood layup offers premium float and control through varied conditions, with an outrageously good Hypderive Base that`ll push your riding to the limit with ease. Don`t forget your lunch, because the CAPiTA The Black Snowboard of Death Snowboard can keep the fun going all day long.', 6.5, 'Directional', 'Twin', 'Directional Hybrid Camber', 'Alpine V1', 'FSC Certified FC Hover Core', NULL, 'Holysheet Triax/Triax Fibreglass', 'Carbon Fleece Power Shield // Amplitex V-Tech Amplifier', 'Magic Bean Resin', 'Hyperdrive Base', NULL, NULL, NULL, 'Full ABS1000 Sidewalls', '4x2', NULL, 0, 0, 0, '2024-02-19 07:30:07', '2024-02-19 07:30:07'),
(66, '', 'CAPiTA', 'Warpspeed', '2020', 'Capita Warpspeed 2020', 'capita-warpspeed-2020', 'Snowboard', '', 'Leave your wet noodle of a board far, far behind you. The CAPiTA Warpspeed Snowboard is all about full speed charging your favorite alpine terrain with no time to pause for selfies. A top-shelf Hyperdrive sintered base and Moonshot Pro-Tune stone grind structure mean business, the absolute best finish you can get for speed and power on a snowboard. The CAPiTA Warpspeed Snowboard is crafted around an FSC Certified Hover Core that is strong and energetic, with V-Tech amplifiers and triaxial fiberglass for big-time dampness and response that big mountain riders can smile about.', 7.5, 'Directional', 'Twin', 'Directional Hybrid Camber', 'Alpine V2', 'FSC Certified Hover Core', NULL, 'Holysheet Triax/Triax Fibreglass', 'Amplitex V-Tech Amplifier', 'Magic Bean Resin', 'Hyperdrive Base', NULL, NULL, NULL, 'Full ABS1000 Sidewalls', '4x2', NULL, 0, 0, 0, '2024-02-19 07:46:51', '2024-02-19 07:46:51'),
(67, '', 'CAPiTA', 'Kazu Kokubo Pro', '2020', 'Capita Kazu Kokubo Pro 2020', 'capita-kazu-kokubo-pro-2020', 'Snowboard', '', 'Only one person gets to be Kazu Kokubo, but everyone can get a board inspired by Kazu`s legendary powder slashing, full-send, what-did-I-just-see style. A setback wood, bamboo, carbon, and flax board, the CAPiTA Kazu Kokubo Pro Snowboard is here to attack the mountain with grace, flow, and a high-flying, powder-hungry attitude. Its premium Hyperdrive Base was made for the speed junkies out there who love to step on the gas and let gravity sort things out. This multiple Good Wood winner loves to surf and float, with a nose for exploring fresh untouched lines away from the crowds. The CAPiTA Kazu Kokubo Pro Snowboard is the snowboarder`s snowboard.', 6.5, 'Directional', 'Twin', 'Directional Camber', 'Alpine V3', 'FSC Certified Panda Core', NULL, 'Holysheet Triax/Biax Fibreglass', 'Amplitex V-Tech Amplifier', 'Magic Bean Resin', 'Hyperdrive Base', NULL, NULL, NULL, 'Full ABS1000 Sidewalls', '4x2', NULL, 0, 0, 0, '2024-02-19 07:50:47', '2024-02-19 07:50:47'),
(68, '', 'CAPiTA', 'Supernova', '2020', 'Capita Supernova 2020', 'capita-supernova-2020', 'Snowboard', '', 'The CAPiTA Supernova Snowboard has been supercharged with the latest components for the power you need to take on the mountain and laugh at varied terrain, `slow down` signs, and the thought of just taking it easy out there. An FSC certified P2 Superlight Core is low on grams and high on pop, with carbon kevlar beams for epic strength and the performance that gravity enthusiasts crave for sticking it to concepts like physics or caution. Burst with cosmic joy, because the CAPiTA Supernova Snowboard is the tool you need to explore the many dimensions of big mountain terrain.', 6.5, 'Directional', 'Twin', 'Directional Camber', 'Alpine V3', 'FSC Certified P2 Superlight Core', NULL, 'Holysheet Triax/Biax Fibreglass', 'Carbon Kevlar Beams', 'Magic Bean Resin', 'Quantum Drive Base', NULL, NULL, NULL, 'Full ABS1000 Sidewalls', '4x2', NULL, 0, 0, 0, '2024-02-19 07:55:15', '2024-02-19 07:55:15'),
(69, '', 'CAPiTA', 'Equalizer', '2020', 'Capita Equalizer 2020', 'capita-equalizer-2020', 'Snowboard', '', 'The CAPiTA The Equalizer Snowboard is here to help bring balance to the world of snowboarding - this ladies specific, high-performance all-mountain shredder with little regard for the disclaimers on the back of your lift ticket doesn`t come along very often! The Equalizer is all about speed, performance, and the ability to take the more inspired line with confidence. Technora and flax boosters give you extra power and pop you need for getting sendy, whether that means going airborne, floating through untouched freshies or experiencing the g-forces of full-bore corduroy carving.', 5, 'Directional', 'Directional', 'Directional Hybrid Camber', 'Alpine V1', 'Dual Blaster Ashpop Core', NULL, 'Holysheet Triax/Biax Fibreglass', 'Carbon Kevlar Beams', 'Magic Bean Resin', 'Quantum Drive Base', NULL, NULL, NULL, 'Full ABS1000 Sidewalls', '4x2', NULL, 0, 1, 0, '2024-02-19 08:02:53', '2024-02-19 08:02:53'),
(70, '', 'CAPiTA', 'Super DOA', '2020', 'Capita Super DOA 2020', 'capita-super-doa-2020', 'Snowboard', '', 'The alien king is back, and he has upgrades. The CAPiTA Super DOA Snowboard is straight out of the dreams of snowboarders everywhere and headed right for the galactic snowboarding throne, laying siege to the hill with an army of performance upgrades, here to take no prisoners. Its FSC Certified 3D Hover Core is chosen for its outstanding minimal weight, huge pop, and mountain-ready resilience, mated to Holysheet triaxial fiberglass and an Amplitex Amplifier grid for power and precision that is the pride of The Mothership. Set coordinates, engage warp speed, and put the selfie stick down, because a super fast Hypderdrive base and a factory pro-tune are for super-charged riding, not for likes and follows. The CAPiTA Super DOA Snowboard is about do-everything excellence, bud, so tie on your cape and come ready to Defend Awesome for the people.', 6, 'Twin', 'Twin', 'Hybrid Camber', 'Resort V1', 'FSC Certified 3D Hover Core', NULL, 'Holysheet Triax/Triax Fibreglass', 'Amplitex Amplifier', 'Magic Bean Resin', 'Hyperdrive Base', NULL, NULL, NULL, 'Full ABS1000 Fortress Kevlar Bound Sidewalls', '4x2', NULL, 0, 0, 0, '2024-02-19 08:18:51', '2024-02-19 08:18:51'),
(71, '', 'CAPiTA', 'Mercury', '2020', 'Capita Mercury 2020', 'capita-mercury-2020', 'Snowboard', '', 'Icarus might have flown too close to the sun, but when you hop on the CAPiTA Mercury Snowboard you might question Icarus` commitment to the send. Fly high, snowboarders, and ride fast with style. This all-terrain menace to the `pizza, french fry` slowpokes is just waiting for permission to launch, get steep and impress in the park. The FSC Certified Panda Core features bamboo rods for extra durability and power, reinforced by V-Tech woven tech tape for a ride that would make the Apollo astronauts envious. Close the airspace, because the CAPiTA Mercury Snowboard wants to take your all-terrain riding to the stratosphere.', 6.5, 'Directional Twin', 'Directional', 'Hybrid Camber', 'Resort V2', 'FSC Certified Panda Core', NULL, 'Holysheet Triax/Biax Fibreglass', 'Amplitex V-Tech Amplifier', 'Magic Bean Resin', 'Hyperdrive Base', NULL, NULL, NULL, 'Full ABS1000 Sidewalls', '4x2', NULL, 0, 0, 0, '2024-02-19 08:23:22', '2024-02-19 08:23:22'),
(72, '', 'CAPiTA', 'Asymulator', '2020', 'Capita Asymulator 2020', 'capita-asymulator-2020', 'Snowboard', '', 'Lower your shields, human. The CAPiTA Asymulator Snowboard is here and you will be Asymulated. This all-terrain freestyle ripper features asymmetrical heel and toe edges for sci-fi levels of control to complement a responsive Technora and flax core and a wicked fast Quantam Drive base. A versatile board with few peers, you can hop on an Asymulator and tweak, grab, leap, carve, or mug for the camera with the confidence that comes with a deck made to play wherever gravity and snow allow. Like any starship worth its warp drive, the CAPiTA Asymulator Snowboard blends human ingenuity with a fast and nimble construction that impresses from this galaxy to the next.', 6, 'Twin', 'Twin', 'Hybrid Camber', 'Resort V1', 'FSC Certified P2 Superlight Core', NULL, 'Holysheet Triax/Biax Fibreglass', 'Technora + Flax Boosters', 'Magic Bean Resin', 'Quantum Drive Base', NULL, NULL, NULL, 'Full ABS1000 Sidewalls', '4x2', 1, 0, 0, 0, '2024-02-19 16:52:54', '2024-02-19 16:52:54');
INSERT INTO `SkiBoards` (`skiboard_id`, `url`, `brand`, `model`, `year`, `name`, `slug`, `category`, `family`, `description`, `stiffness`, `shape`, `flex_profile`, `camber_profile`, `camber_details`, `core`, `core_profiling`, `fibreglass`, `laminates`, `resin`, `base`, `edges`, `edge_tech`, `topsheet`, `sidewall`, `inserts`, `asym`, `weight`, `womens`, `youth`, `created`, `updated`) VALUES
(73, '', 'CAPiTA', 'Birds of a Feather', '2020', 'Capita Birds of a Feather 2020', 'capita-birds-of-a-feather-2020', 'Snowboard', '', 'Mess with some birds and you deal with the whole flock. The CAPiTA Birds of a Feather Snowboard has clawed its way to the top with the precise power and pop of its Carbon Fiber Beam and fiberglass reinforcements laminated to an exceptionally light but fierce beech and poplar wood core. A new, super fast sintered Quantum Drive Base slides its way to top speed like a fully committed peregrine falcon and gives you the pep you need for redlining your way down the groomers, into the park, and for dancing your way through the weekend crowd. There`s strength in numbers, but you don`t need math or the masses to know that the CAPiTA Birds of a Feather Snowboard is one seriously capable do-everything deck.', 5, 'Twin', 'Twin', 'Hybrid Camber', 'Resort V1', 'FSC Certified Duel Core', NULL, 'Special Blend Biax/Biax Fibreglass', 'Carbon Fiber Beams', 'Magic Bean Resin', 'Quantum Drive Base', NULL, NULL, NULL, 'Fortress Kevlar Bound Sidewalls', '4x2', 0, 0, 1, 0, '2024-02-19 17:37:07', '2024-02-19 17:37:07'),
(74, '', 'CAPiTA', 'Navigator', '2020', 'Capita Navigator 2020', 'capita-navigator-2020', 'Snowboard', '', 'Captain, there`s powder ahead! Like an iceberg, there`s massive potential just beneath the surface of the deceptively subtle looks of the CAPiTA Navigator Snowboard. Setback and tapered for float and control in the steep, deep, and glorious, the CAPiTA Navigator Snowboard is your trusted first mate to help you get through seas of fresh champagne and the contoured waves of corduroy. A high-speed Quantum Drive Base is quick like a mako, its core juiced up with carbon fiber beams for taking on the winter storm with flagship poise. Anchors aweigh, it`s time to rip.', 6, 'Directional', 'Directional', 'Directional Flat', 'Alpine V4', 'FSC Certified Duel Core', NULL, 'Special Blend Biax/Biax Fibreglass', 'Carbon Fiber Beams', 'Magic Bean Resin', 'Quantum Drive Base', NULL, NULL, NULL, 'Full ABS1000 Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 17:41:24', '2024-02-19 17:41:24'),
(75, '', 'CAPiTA', 'Paradise', '2020', 'Capita Paradise 2020', 'capita-paradise-2020', 'Snowboard', '', 'Score freshies early, blast the choppy stuff when it`s all tracked out, rip some groomers after, and take some laps through the park before last chair to show your friends and ego that you`ve still got it. The CAPiTA Paradise Snowboard is the deck you want to get the most fun out of almost any terrain. A medium flex offers a well-balanced blend of fall line stability and mobility for the versatile, jib-it-all creative riders out there. Make the mountain your playground and explore with confidence on the CAPiTA Paradise Snowboard.', 5, 'Twin', 'Twin', 'Hybrid Camber', 'Resort V3', 'FSC Certified Duel Core', NULL, 'Special Blend Biax/Biax Fibreglass', 'Inlaid HD Titanal Struts', 'Magic Bean Resin', 'Superdrive EX Base', NULL, NULL, NULL, 'ABS1000 Sidewalls', '4x2', 0, 0, 1, 0, '2024-02-19 18:01:41', '2024-02-19 18:01:41'),
(76, '', 'CAPiTA', 'Children of the Gnar', '2020', 'Capita Children of the Gnar 2020', 'capita-children-of-the-gnar-2020', 'Snowboard', '', 'It`s what separates the boys from the men -- literally. The CAPiTA Children Of The Gnar Snowboard is for those `tweeners` that are too grown up for the kids stuff and not quite big enough for a bigger board to make sense. The CAPiTA Children Of The Gnar Snowboard is no toy. This board can go anywhere and do anything on the mountain, from practicing those ridiculous trick progressions and transfers to cruising around with friends and family.', 3.5, 'Twin', 'Twin', 'Hybrid Camber', 'Resort V1', 'FSC Certified Select Core', NULL, 'Special Blend Biax/Biax Fibreglass', '', 'Magic Bean Resin', 'XXX[TRUDED] Base', NULL, NULL, NULL, 'ABS1000 Sidewalls', '4x2', 0, 0, 0, 1, '2024-02-19 18:05:10', '2024-02-19 18:05:10'),
(77, '', 'CAPiTA', 'Scott Stevens Pro', '2020', 'Capita Scott Stevens Pro 2020', 'capita-scott-stevens-pro-2020', 'Snowboard', '', 'Don`t let those park and urban go up in smoke just yet - the CAPiTA Scott Stevens Pro Snowboard is all about pushing the limits of self-expression on a snowboard, from the park to the parking lot to the hood of the mall cop`s car. It`s not rocket science -- if you want a board that`s made for getting wild and creative so long as you`ve got something cool to slide on, you want the CAPiTA Scott Stevens Pro Snowboard.', 5, 'Twin', 'Twin', 'Hybrid Flat', 'Park V2', 'Cork Inlaid Pro Core', NULL, 'Holysheet Triax/Biax Fibreglass', '2-Ply Basalt Boosters', 'Magic Bean Resin', 'Quantum Drive Base', NULL, NULL, NULL, '1.5mm Cork Edge Dampening System // ABS1000 Sidewalls', '4x2', 0, 0, 0, 1, '2024-02-19 18:13:12', '2024-02-19 18:13:12'),
(78, '', 'CAPiTA', 'Outerspace Living', '2020', 'Capita Outerspace Living 2020', 'capita-outerspace-living-2020', 'Snowboard', '', 'Freeriders with freestyle intentions, your new inbounds and sidecountry quiver killer is here. Way better than actually living in outerspace, the CAPiTA Outerspace Living Snowboard doesn`t make you eat that freeze-dried Neapolitan nonsense. The only thing the CAPiTA Outerspace Living Snowboard hungers for is sick terrain to launch itself off of and fresh pockets of pow to play in, and with a Superdrive EX Base, this Good Wood winner is ready to glide smoothly into the next dimension of sideways-sliding fun. If you need a confidence check, just remember that you`ve got heavy duty Titanal struts beneath your feet and huck it.', 5, 'Twin', 'Twin', 'Hybrid Camber', 'Resort V3', 'FSC Certified Duel Core', NULL, 'Special Blend Biax/Biax Fibreglass', 'Inlaid HD Titanal Struts', 'Magic Bean Resin', 'Superdrive EX Base', NULL, NULL, NULL, 'ABS1000 Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 18:25:08', '2024-02-19 18:25:08'),
(79, '', 'CAPiTA', 'Outsiders', '2020', 'Capita Outsiders 2020', 'capita-outsiders-2020', 'Snowboard', '', 'The next generation of park riding demands a board with the futuristic performance and pedigree worthy enough to handle it. Enter the CAPiTA The Outsiders Snowboard. This Good Wood winner is reinforced with ultralight and super poppy materials like Technora and flax for on-demand performance on a traditionally cambered profile. Load up the CAPiTA The Outsiders Snowboard, jump huge, carry more speed, and send with confidence.', 6, 'Twin', 'Twin', 'Hybrid Camber', 'Park V1', 'FSC Certified P2 Superlight Core', NULL, 'Holysheet Triax/Biax Fibreglass', 'Technora + Flax Boosters', 'Magic Bean Resin', 'Quantum Drive Base', NULL, NULL, NULL, 'ABS1000 Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 18:28:54', '2024-02-19 18:28:54'),
(80, '', 'CAPiTA', 'Indoor Survival', '2020', 'Capita Indoor Survival 2020', 'capita-indoor-survival-2020', 'Snowboard', '', 'The CAPiTA Indoor Survival Snowboard is all about wall-hits, cat track sends, pipes, parks, groomers, and getting the most fun out of a season at your local resort. Heavy duty, extra thick Titanal struts reinforce the poppy and durable poplar and beech core for better ollies and more smiles on lap after lap of your favorite features. If your indoor survival is waiting for the snows the return, celebrate the season with the playful CAPiTA Indoor Survival Snowboard.', 5, 'Twin', 'Twin', 'Hybrid Camber', 'Park V1', 'FSC Certified Duel Core', NULL, 'Special Blend Biax/Biax Fibreglass', 'Inlaid HD Titanal Struts', 'Magic Bean Resin', 'Quantum Drive Base', NULL, NULL, 'PLT Topsheet', 'ABS1000 Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 18:31:20', '2024-02-19 18:31:20'),
(81, '', 'CAPiTA', 'Horrorscope', '2020', 'Capita Horrorscope 2020', 'capita-horrorscope-2020', 'Snowboard', '', 'Remember when snowboarding was just about having fun and goofing off with the buds? Maybe it still is. The CAPiTA Horrorscope Snowboard is the maneuverable skate-like deck for your asphalt-inspired urban and park riding sessions. It`s just like old times, only with modern tech like a durable Superdrive EX sintruded base for a smooth ride and durability you need in the long run. Set your pizza and bevy down, there`s a sick feature your friends have been hitting and the CAPiTA Horrorscope Snowboard is calling your name to join the party.', 4, 'Twin', 'Twin', 'Hybrid Flat', 'Park V2', 'FSC Certified Select Core', NULL, 'Special Blend Biax/Biax Fibreglass', '', 'Magic Bean Resin', 'Superdrive EX Base', NULL, NULL, NULL, 'ABS1000 Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 18:34:36', '2024-02-19 18:34:36'),
(82, '', 'CAPiTA', 'Space Metal Fantasy', '2020', 'Capita Space Metal Fantasy 2020', 'capita-space-metal-fantacy-2020', 'Snowboard', '', 'Is this real life or is this the CAPiTA Space Metal Fantasy Snowboard? It`s both, though the dream-like playfulness and unreal progression-friendly ride of the CAPiTA Space Metal Fantasy Snowboard might have you pinching yourself to double check. A medium-flexing rocker-flat-rocker construction with a durable Superdrive EX sintruded base makes for a park-happy and all-terrain capable wonderplank for the boarder that loves to cruise, improve, and find their own groove from first chair to last.', 4, 'Twin', 'Twin', 'Hybrid Flat', 'Park V2', 'FSC Certified Select Core', NULL, 'Special Blend Biax/Biax Fibreglass', '', 'Magic Bean Resin', 'Superdrive EX Base', NULL, NULL, 'PLT Topsheet', 'ABS1000 Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 18:37:23', '2024-02-19 18:37:23'),
(83, '', 'CAPiTA', 'Scott Stevens Mini', '2020', 'Capita Scott Stevens Mini 2020', 'capita-scott-stevens-mini-2020', 'Snowboard', '', 'Did junior really just do that trick that you`ve been dreaming of landing your entire life and look really cool doing it? That means it`s time to elevate your grom`s snowboarding with the CAPiTA Scott Stevens Mini Snowboard. This progression-friendly board is light and nimble enough for the young jibber, with an extruded base for boxes, bumps, jumps, and oopses.', 3, 'Twin', 'Twin', 'Hybrid Flat', 'Park Mini', 'FSC Certified Select Core', NULL, 'Micro-Glass', '', 'Magic Bean Resin', 'XXX[TRUDED] Base', NULL, NULL, NULL, 'ABS1000 Sidewalls', '4x2', 0, 0, 0, 1, '2024-02-19 18:39:55', '2024-02-19 18:39:55'),
(84, '', 'CAPiTA', 'Micro Mini', '2020', 'Capita Micro Mini 2020', 'capita-micro-mini-2020', 'Snowboard', '', 'Snowboarding is fun, but catching an edge sucks. Set junior up right with the CAPiTA Micro Mini Snowboard, an easy turning, great-for-learning rockered board for the groms just venturing out into the cold stuff. A durable extruded base is perfect for those `uh-oh` occasions without sacrificing on capabilities.', 3, 'Twin', 'Twin', 'Hybrid Flat', 'Park Mini', 'Poplar Core', NULL, 'Micro-Glass', '', 'Magic Bean Resin', 'XXX[TRUDED] Base', NULL, NULL, NULL, 'ABS1000 Sidewalls', '4x2', 0, 0, 0, 1, '2024-02-19 18:41:44', '2024-02-19 18:41:44'),
(85, '', 'CAPiTA', 'Powder Glider', '2020', 'Capita Powder Glider 2020', 'capita-powder-glider-2020', 'Snowboard', 'Spring Break', 'The CAPiTA Spring Break Powder Glider Snowboard 2020 is wide, surfy, and surprisingly agile for a board of its size. This powder board loves to get out into the soft and deep and take on whatever terrain you throw its way on the way to glory. The Powder Drive base stokes you out through the trees, down the steeps, and doesn`t bother to stop and collect $200 while booking it through the flats. Shake your fist at the clouds and demand pow, immediately.', 6, 'Directional', 'Twin', 'Directional Flat', 'Surf Rocker', 'Surflite 2.0 Core', NULL, 'Holysheet Triax/Triax Fibreglass', 'Forged Carbon Quad Packs', 'Magic Bean Resin', 'Powder Drive Base', NULL, NULL, 'Core Ash Woodgrain Topsheet', 'FUS3D Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 18:56:58', '2024-02-19 18:56:58'),
(86, '', 'CAPiTA', 'Nighthawk', '2020', 'Capita Nighthawk 2020', 'capita-nighthawk-2020', 'Snowboard', 'Spring Break', 'Not enough swoop to the tail of your pow board? We got the swoops right here for you in the CAPiTA Spring Break Nighthawk Swallowtail Snowboard, a nimble steep and deep giant with a combination of agility and flotation that may surprise you. Wa-pow, spray your friends while you surf down the mountain on a super light Surflite 2.0 core with forged carbon reinforcements and a super speedy, super durable Powder Drive base beneath you.', 6, 'Directional', 'Twin', 'Directional Flat', 'Surf Rocker', 'Surflite 2.0 Core', NULL, 'Holysheet Triax/Triax Fibreglass', 'Forged Carbon Quad Packs', 'Magic Bean Resin', 'Powder Drive Base', NULL, NULL, 'Core Ash Woodgrain Topsheet', 'FUS3D Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 18:58:38', '2024-02-19 18:58:38'),
(87, '', 'CAPiTA', 'Tree Hunter', '2020', 'Capita Tree Hunter 2020', 'capita-tree-hunter-2020', 'Snowboard', 'Spring Break', 'Spend enough time in Corey Smith`s garage and you might stare at a piece of plywood long enough for an idea like the CAPiTA Spring Break Tree Hunter Snowboard 2020 to pop into your mind like the thought of hot `za when the sun dips behind the mountain. Don`t get too lost in a mozzarella dreamland after reading that, because this board is the realest pow-slaying deal, built with forged carbon quad packs for power on an ultra-light Surflite 2.0 Core with CAPiTA`s aptly named Surf Rocker for floaty goodness. The Powder Drive base is fast and durable, perfect for driving through white waves everywhere. Bring the ruckus.', 6, 'Directional', 'Twin', 'Directional Flat', 'Surf Rocker', 'Surflite 2.0 Core', NULL, 'Holysheet Triax/Triax Fibreglass', 'Forged Carbon Quad Packs', 'Magic Bean Resin', 'Powder Drive Base', NULL, NULL, 'Core Ash Woodgrain Topsheet', 'FUS3D Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 18:59:33', '2024-02-19 18:59:33'),
(88, '', 'CAPiTA', 'Mini Tree Hunter', '2020', 'Capita Mini Tree Hunter 2020', 'capita-mini-tree-hunter-2020', 'Snowboard', 'Spring Break', 'Spend enough time in Corey Smith`s garage and you might stare at a piece of plywood long enough for an idea like the CAPiTA Spring Break Mini Tree Hunter Snowboard 2020 to pop into your mind like the thought of hot `za when the sun dips behind the mountain. Don`t get too lost in a mozzarella dreamland after reading that, because this board is the realest pow-slaying deal, built with forged carbon quad packs for power on an ultra-light Surflite 2.0 Core with CAPiTA`s aptly named Surf Rocker for floaty goodness. The Powder Drive base is fast and durable, perfect for driving through white waves everywhere. Bring the ruckus.', 6, 'Directional', 'Twin', 'Directional Flat', 'Surf Rocker', 'Surflite 2.0 Core', NULL, 'Holysheet Triax/Triax Fibreglass', 'Forged Carbon Quad Packs', 'Magic Bean Resin', 'Powder Drive Base', NULL, NULL, 'Core Ash Woodgrain Topsheet', 'FUS3D Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 19:00:49', '2024-02-19 19:00:49'),
(89, '', 'CAPiTA', 'Powder Drifter', '2020', 'Capita Powder Drifter 2020', 'capita-powder-drifter-2020', 'Snowboard', 'Spring Break', 'Do you like drifting in pow-pow? Of course you do. So does CAPiTA, and they`re here to enable your addiction. Feast your eyes and your feet on the CAPiTA Spring Break Powder Drifter Snowboard, a Powder Drive sliding machine with forged carbon reinforcements for pop without sluggishness and a super buoyant Surflite 2.0 Core for helping you stay up on your powder game. The rounded nose and hybrid tail make it fun to slash, slip, and surf the mountain in deep conditions.', 6, 'Directional', 'Twin', 'Directional Flat', 'Surf Rocker', 'Surflite 2.0 Core', NULL, 'Holysheet Triax/Triax Fibreglass', 'Forged Carbon Quad Packs', 'Magic Bean Resin', 'Powder Drive Base', NULL, NULL, 'Core Ash Woodgrain Topsheet', 'FUS3D Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 19:01:39', '2024-02-19 19:01:39'),
(90, '', 'CAPiTA', 'Powder Racer', '2020', 'Capita Powder Racer 2020', 'capita-powder-racer-2020', 'Snowboard', 'Spring Break', 'True to its name, this new addition to Corey Smith`s Spring Break collection just wants you to turn on the jets - whether that`s the local banked slalom course or blasting the white wave after the nightly refresh, this thing carries serious speed. True to the original garage built, oversized plywood decks, the Powder Racer features an extra-wide nose, girthy mid-body and a tapered tail for a board that just wants to blast off!', 5, 'Directional', 'Twin', 'Directional Flat', 'Surf Rocker', 'FSC Certified P2 Core', NULL, 'Holysheet Triax/Biax Fibreglass', 'Technora + Flax Boosters', 'Magic Bean Resin', 'Powder Drive Base', NULL, NULL, 'PLT Topsheet', 'ABS1000 Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 19:08:06', '2024-02-19 19:08:06'),
(91, '', 'CAPiTA', 'Slush Slasher', '2020', 'Capita Slush Slasher 2020', 'capita-slush-slasher-2020', 'Snowboard', 'Spring Break', 'The CAPiTA Spring Break Slush Slasher Snowboard is a real contradiction - this short-board rails on groomers, jibs like no other directional board while shredding powder days too. Built at the Mothership with durable, low maintenance materials, with a poppy light weight core and inlaid alloy skid plate for SPARKS, the Slush Slasher is a smile-inducing ride that you can whip out for pow day and spring pond skims alike.', 4, 'Directional', 'Twin', 'Directional Flat', 'Party Profile', 'FSC Certified Select Core', NULL, 'Special Blend Biax/Biax Fibreglass', 'Technora + Flax Boosters', 'Magic Bean Resin', 'Superdrive EX Base', NULL, NULL, 'PLT Topsheet', 'ABS1000 Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 19:10:38', '2024-02-19 19:10:38'),
(92, '', 'CAPiTA', 'Ultrafear', '2020', 'Capita Ultrafear 2020', 'capita-ultrafear-2020', 'Snowboard', '', 'It`s a style-fiend`s world out there, and the CAPiTA Ultrafear Snowboard is here to help you live in it. Cork Edge Dampening protects your steed from the inevitable blunt force impacts, with Kevlar/Titanal Body Armor for futuristic performance from the local rail spot to the mountain terrain park. Built on a Park V2 profile with zero camber between the inserts and a rockered tip and tail to minimize the odds of edge-catch disaster, this deck is all about ollies and resiliency. Take a deep breath, visualize, and get after it. The CAPiTA Ultrafear Snowboard is the king of the highlight reel.', 5.5, 'Twin', 'Twin', 'Hybrid Flat', 'Park V2 Profile', 'Duel Blaster Ashop Core', NULL, 'Holysheet Triax/Biax Fibreglass', 'Kevlar/Titanal Body Armour', 'Magic Bean Resin', 'Superdrive EX Base', NULL, NULL, 'PLT Topsheet', '1.5mm Cork Edge Dampening // ABS1000 Sidewalls', '4x2', 0, 0, 0, 0, '2024-02-19 19:21:25', '2024-02-19 19:21:25'),
(97, '', 'Ride', 'Adgenda', '2020', 'Ride Adgenda 2020', 'ride-adgenda-2020', 'Snowboard', '', 'Make snowboarding a priority this winter and get on the Ride Agenda Snowboard. Its simple design features a true twin shape, a snappy aspen wood core, and deep rocker lines for point-and-shoot riding, along with a quadratic sidecut for easy, catch free turns. Clear your schedule and put the Ride Agenda on your calendar today.', 3, 'Twin', '', 'Hybrid Camber', '', 'Foundation Core', '', 'Biaxial Glass', 'Single Impact Plates', '', 'Extruded, Stone Ground Base', NULL, '', '', 'Slimewalls', '4x2', 0, 0, 0, 0, '2024-03-19 01:00:13', '2024-03-19 01:00:13'),
(98, '', 'Ride', 'Manic', '2020', 'Ride Manic 2020', 'ride-manic-2020', 'Snowboard', '', 'Dance like you`ve never danced before with the Ride Manic Snowboard. This directional shredster is versatile, smooth, and super reliable when things get choppy. The lightweight aspen core is laid up with carbon stringers for added pop to fuel your moves, and the quadratic sidecut with generous tip rocker makes for easy turning through powder and chop. It`s time to get wild!', 3, 'Twin', '', 'Directional Hybrid Camber', '', 'Foundation Core', '', 'Biaxial Glass', 'Single Impact Plates ~ Linear Carbon', '', 'Extruded, Stone Ground Base', NULL, '', '', 'Slimewalls', '4x2', 0, 0, 0, 0, '2024-03-20 05:42:40', '2024-03-20 05:42:40'),
(99, '', 'Ride', 'Heartbreaker', '2020', 'Ride Heartbreaker 2020', 'ride-heartbreaker-2020', 'Snowboard', '', 'No word yet on what Pat Benatar thinks of the Ride Heartbreaker Snowboard, but we can attest to this board being an all-mountain queen. Designed with a twin hybrid rocker for freestyle excellence, this true twin shape has a versatile sidecut that`s perfect for chill turns, catch-free riding, and taking some laps through the park. Crafted with a mellow response and a Women`s Specific Performance Core, this board`s lively pop is easy to ride and handles like a true dream-maker in every condition. Whatever you get after, at whatever skill level, the Heartbreaker is the right kind of dreamer, to release your inner fantasy.', 3, 'Twin', '', 'Hybrid Camber', '', 'Women`s Specific Performance Core', '', 'Biaxial Glass', 'Single Impact Plates', '', 'Extruded, Stone Ground Base', NULL, '', '', 'Slimewalls', '4x2', 0, 0, 1, 0, '2024-03-20 23:30:46', '2024-03-20 23:30:46'),
(100, '', 'Ride', 'Kink', '2020', 'Ride Kink 2020', 'ride-kink-2020', 'Snowboard', '', 'Jibs, knucks, or rollers, whatever you`re into the Ride Kink Snowboard is the freestyle slayer that`s made to take a hit. Thanks to double impact plates, Cleave Edge Steel edges, and some oops-resistant Roll-In Slimewalls, this board is the ultimate combination of durability meets finesse. The Ride Kink Snowboard aims for a catch-free ride that`s ready to blast through the park, the groomers, or whatever style of riding makes you happiest.', 3, 'Twin', '', 'Hybrid Camber', '', 'Performance Core', '', 'Biaxial Glass', 'Single Impact Plates', '', 'Extruded, Stone Ground Base', 'Cleave Edge Steel', '', '', 'Roll-In Slimewall', '4x2', 0, 0, 0, 0, '2024-03-21 00:03:30', '2024-03-21 00:03:30'),
(101, '', 'Ride', 'Machete', '2020', 'Ride Machete 2020', 'ride-machete-2020', 'Snowboard', '', 'Hack and slash your way to freestyle fun on the Ride Machete Snowboard. A quadratic sidecut makes turn initiation and exit smooth and dreamy while offering great edge grip throughout your carves. Carbon reinforcements add pop and power without holding you back with heaps of weight, and the medium flex of the Ride Wildlife Snowboard is perfect for riding park laps, groomer runs, and beyond. This true twin trickster is great for the park rat or for do-it-all riders who love to play around on the mountain.', 5, 'Twin', '', 'Hybrid Camber', '', 'Performance Core', '', 'Biaxial Glass', 'Carbon Array 3 ~ Carbon Slimerods ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', 'Cleave Edge Steel', '', '', 'Roll-In Slimewall', '4x2', 0, 0, 0, 0, '2024-03-21 00:06:24', '2024-03-21 00:06:24'),
(102, '', 'Ride', 'Twinpig', '2020', 'Ride Twinpig 2020', 'ride-twinpig-2020', 'Snowboard', '', 'The Ride Twinpig Snowboard takes the success of the Warpig and tweaks the profile for riders who loves switch riding and freestyle fun all over the hill. Made with a wider tip and tail for the perfect freestyle shovel shape, the Ride Twinpig Snowboard is hungry to handle pow-pow, groomers, and the roof of your mom`s sedan in style. For best results, size down from your standard board and pair with a surfy binding.', 5, 'Twin', '', 'Hybrid Camber', '', 'Foundation Core', '', 'Hybrid Glass', 'Double Impact Plates', '', 'Sintered, Stone Ground Base', 'Cleave Edge Steel', '', 'Topless Construction', 'Roll-In Slimewall', '4x2', 1, 0, 0, 0, '2024-03-21 00:10:18', '2024-03-21 00:10:18'),
(103, '', 'Ride', 'Saturday', '2020', 'Ride Saturday 2020', 'ride-saturday-2020', 'Snowboard', '', 'Saturdays are for shredding. You know this, that`s why you`re shopping for the Ride Saturday Snowboard, a freaking rad twin board loaded up with carbon and glass for lightweight ripping and the power to get you up and over with smooth control and tons of speed. A sintered base makes sure the acceleration is there when you need it, with steel edges and impact reinforcement designed to hold up through your progressions. Rip the Ride Saturday Snowboard until there is no weekend left or go up on a weekday and make it your own personal holiday.', 5, 'Twin', '', 'Hybrid Camber', '', 'Women`s Specific Performance Core', '', 'Hybrid Glass', 'Carbon Array 3 Laminates ~ Linear Carbon ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', 'Cleave Edge Steel', '', '', 'Slimewalls', '4x2', 0, 0, 1, 0, '2024-03-21 00:12:52', '2024-03-21 00:12:52'),
(104, '', 'Ride', 'Helix', '2020', 'Ride Helix 2020', 'ride-helix-2020', 'Snowboard', '', 'The Ride Helix Snowboard is the park ready board that`s perfect for when you`re looking to throw down a little all-mountain debauchery. Featuring a Twin Hybrid Rocker for balanced response and playfulness with an asymmetrical shape, this workhorse is perfect for locking in heelside turns and gettin` sendy on enticing terrain. For those looking for a board that`s ready to help you work on an ever-expanding trick list, look to the Ride Helix Snowboard as your new buddy.', 7, 'Twin', '', 'Hybrid Camber', '', 'Performance Core', '', 'Hybrid Glass', 'Carbon Array 3 Laminates ~ Carbon Slimerods ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', 'Cleave Edge Steel', '', '', 'Roll-In Slimewall', '4x2', 1, 0, 0, 0, '2024-03-21 00:18:00', '2024-03-21 00:18:00'),
(105, '', 'Ride', 'Burnout', '2020', 'Ride Burnout 2020', 'ride-burnout-2020', 'Snowboard', '', 'The Ride Burnout Snowboard has one simple objective to destroy the park and be the gnarliest on the hill. True to that end, the Burnout is capable of tricks and sends with confidence unseen by the likes of inferior boards. A linear twin sidecut gives excellent edge control and stability for park and groomer shenanigans, while a super fast sintered base helps the world whiz past you. Freestyle riders who need something that can keep up can look to the Ride Burnout Snowboard for a boost.', 7, 'Twin', '', 'Hybrid Camber', '', 'Performance Core', '', 'Hybrid Glass', 'Carbon Array 5 Laminates ~ Carbon Slimerods ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', 'Cleave Edge Steel', '', '', 'Roll-In Slimewall ~ Carbon Slimewalls', '4x2', 0, 0, 0, 0, '2024-03-21 00:25:26', '2024-03-21 00:25:26'),
(106, '', 'Ride', 'Back Talk', '2020', 'Ride Back Talk 2020', 'ride-back-talk-2020', 'Snowboard', '', 'Be careful with this board, disrespect it and you might get floored. Do right by it and you`ll find yourself with a loyal mountain companion that`ll stay by your side through thick powder and thin cover. The Ride Back Talk Snowboard is freestyle beast loaded with pop and power for high-flying rippers. The asymmetrical twin shape, quadratic sidecut, and stiff flex make this lightweight stick a twitchy fast, super responsive savage in the park and all over the frontside.', 7, 'Twin', '', 'Hybrid Camber', '', 'Women`s Specific Performance Core', '', 'Hybrid Glass', 'Carbon Array 5 Laminates ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', 'Cleave Edge Steel', '', '', 'Roll-In Slimewall ~ Carbon Slimewalls', '4x2', 1, 0, 1, 0, '2024-03-21 00:29:34', '2024-03-21 00:29:34'),
(107, '', 'Ride', 'Wild Life', '2020', 'Ride Wild Life 2020', 'ride-wild-life-2020', 'Snowboard', '', 'The Ride Wildlife Snowboard captures all you need for making the most out of storm-fueled or regular groomer days on the hill. Made with a Directional Hybrid Camber, you can float and rip your way down the corduroy, through the trees, and on the road less traveled. A soft and playful flex with a smooth ride are perfect for days when you don`t know exactly what will be thrown at you but you want to be on a board that can handle it all. Go ahead and live a little, the Ride Wildlife Snowboard is an enabler.', 4, 'Directional', '', 'Directional Hybrid Camber', '', 'Performance Core', '', 'Hybrid Glass', 'Carbon Array 3 Laminates ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', 'Standard Steel Edge', '', 'Topless Construction', 'Roll-In Slimewall', '4x2', 0, 0, 0, 0, '2024-03-21 18:59:08', '2024-03-21 18:59:08'),
(108, '', 'Ride', 'Algorythm', '2020', 'Ride Algorythm 2020', 'ride-algorythm-2020', 'Snowboard', '', 'The Ride Algorhythm Snowboard is one of the most fun all-terrain directional twins you can get on this year. Light, poppy, maneuverable, and a pleasure to surf through fresh snow on, it`s easy to find your groove on a board this capable. Explore side terrain, rip the groomers, play in pow stashes, and fall back in love with snowboarding by trying out a board with some personality to it. The Ride Algorhythm Snowboard is ready to help make directional do-it-all riding exciting again.', 6, 'Directional', '', 'Directional Hybrid Camber', '', 'Performance Core', '', '', 'Carbon Array 5 Laminates ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', '', '', 'Pre-Cured Glass', 'Carbon Slimewalls', '4x2', 0, 0, 0, 0, '2024-03-21 19:03:01', '2024-03-21 19:03:01'),
(109, '', 'Ride', 'Compact', '2020', 'Ride Compact 2020', 'ride-compact-2020', 'Snowboard', '', 'The Ride Compact Snowboard is an all-mountain deck for riders in search of a smooth and playful ride for use everywhere. Made with a mellow response and a directional hybrid rocker for extra float with shock absorption through the fresh and soft, this board offers up a ride that`s fun, surfy, and capable. Centered around Ride`s light and nimble Women`s Performance Core, the Ride Compact Snowboard cruises the entire resort with a forgiving personality to help you build confidence and technique on a board with the gumption to handle whatever comes your way.', 4, 'Twin', '', 'Hybrid Camber', '', 'Women`s Specific Performance Core', '', 'Biaxial Fibreglass', 'Carbon Array 5 Laminates ~ Double Impact Plates', '', 'Extruded, Stone Ground Base', 'Standard Steel Edge', '', 'Standard Topsheet', 'Roll-In Slimewall ', '4x2', 0, 0, 1, 0, '2024-03-21 19:09:59', '2024-03-21 19:09:59'),
(110, '', 'Ride', 'Berzerker', '2020', 'Ride Berzerker 2020', 'ride-berzerker-2020', 'Snowboard', '', 'Jake Blauvelt has a reputation that follows him off the side of every cliff. Now you can join in on the madness with the Ride Berzerker Snowboard. This insanely fast board loves to explore every nook and cranny you can find, and thanks to the carbon laminates, the carbon Slimerods, and the Performance Core, this board is ideal for finding heavy sets in the backy or laying some slick lines inbounds. Whatever you do, make sure you stretch first, because the Ride Berzerker Snowboard might inspire you to go HAM.', 7, 'Directional', '', 'Directional Hybrid Camber', '', 'Performance Core', '', 'Hybrid Glass', 'Carbon Array 3 Laminates ~ Carbon Slimerods 2.0 ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', 'Standard Steel Edge', '', 'Standard Topsheet', 'Roll-In Slimewall ', '4x2', 0, 0, 0, 0, '2024-03-21 19:12:29', '2024-03-21 19:12:29'),
(111, '', 'Ride', 'MTNpig', '2020', 'Ride Mtnpig 2020', 'ride-mtnpig-2020', 'Snowboard', '', 'You ever wanted to screw your bindings onto a missile and ride it, full send? Enter the Ride MTNpig Snowboard, a freeride deck from the legendary lineage of Ride`s unstoppable Pig series. Made to go fast and keep turning precision dialed, the Ride MTNpig Snowboard is setback for extra float in the soft stuff, with rocker in the tip and tail for easier turn initiation if you decide you want a different side of your face to carry the aerodynamic load for awhile. Find a mountain big enough to be worthy of your travels, sideways warriors, and let your assault loose!', 6, 'Directional', '', 'Directional Hybrid Camber', '', 'Performance Core', '', 'Carbon Infused Glass', 'Carbon Array 5 Laminates ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', 'Standard Steel Edge', '', 'Wood Veneer', 'Roll-In Slimewall ~ Carbon Slimewalls', '4x2', 0, 0, 0, 0, '2024-03-21 19:17:15', '2024-03-21 19:17:15'),
(112, '', 'Ride', 'Superpig', '2020', 'Ride Superpig 2020', 'ride-superpig-2020', 'Snowboard', '', 'Carbon-fueled and seriously powerful, the Ride Superpig Snowboard is the snow-rocket for aggressive riders who need a responsive and floaty lightning bolt to take on deep Ja-pow trees and Baker big mountain lines with power and purpose, with the guts to get down the groomers and back to the lift with ease. Buckle up, bud, we`re going snowboarding.', 6.5, 'Directional', '', 'Directional Hybrid Camber', '', 'Performance Core', '', 'Carbon Infused Glass', 'Carbon Array 5 Laminates ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', 'Cleave Edge Steel', '', 'Topless Construction', 'Roll-In Slimewall ~ Carbon Slimewalls', '4x2', 0, 0, 0, 0, '2024-03-21 19:20:21', '2024-03-21 19:20:21'),
(113, '', 'Ride', 'Commissioner', '2020', 'Ride Commissioner 2020', 'ride-commissioner-2020', 'Snowboard', '', 'Tapered Elliptical Progressive Sidecut allows for exceptional turn initiation and follow through. New lighter cored aluminum/carbon fiber top sheet increases high-speed control. Paulownia core reduces weight and increases flex properties for snappier turns. The low friction Race Base is made from carbon-infused sintered base material to ensure a fast ride. The Commissioner is designed for intermediate to high level riders seeking high speed all mountain terrain. He sounds pretty serious but the dude will also destroy a powder line. Wink wink.', 8, 'Directional', '', 'Directional Hybrid Camber', '', 'Paulownia Core', '', 'Carbon Infused Glass', 'Carbon Array 5 Laminates ~ Silencer 5 Laminates ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', 'Cleave Edge Steel', '', 'Aluminum Carbon Topsheet', 'Roll-In Slimewall ~ Carbon Slimewalls', '4x2', 0, 0, 0, 0, '2024-03-21 19:28:43', '2024-03-21 19:28:43'),
(114, '', 'Ride', 'Magic Stick', '2020', 'Ride Magic Stick 2020', 'ride-magic-stick-2020', 'Snowboard', '', 'Crafted for all the wicked witches of the hill, the Ride Magic Stick Snowboard is an all-mountain spellcaster destined for debauchery. Featuring the new Women`s Specific Performance Core, this board`s versatile nature is perfect for shredding groomers, lapping the park, or entrancing onlookers all over the mountain. A directional hybrid camber means you`re in for a ride that handles well in everything from powder to crud. The Ride Magic Stick Snowboard is an enchanted quiver-killer that`s all about bringing durability, utility, and finesse wherever you go.', 5.5, 'Directional', '', 'Directional Hybrid Camber', '', 'Women`s Specific Performance Core', '', '', 'Carbon Array 3 Laminates ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', '', '', '', 'Roll-In Slimewall', '4x2', 0, 0, 1, 0, '2024-03-21 19:31:46', '2024-03-21 19:31:46'),
(115, '', 'Ride', 'Magic Stick', '2020', 'Ride Magic Stick 2020', 'ride-magic-stick-2020', 'Snowboard', '', 'Crafted for all the wicked witches of the hill, the Ride Magic Stick Snowboard is an all-mountain spellcaster destined for debauchery. Featuring the new Women`s Specific Performance Core, this board`s versatile nature is perfect for shredding groomers, lapping the park, or entrancing onlookers all over the mountain. A directional hybrid camber means you`re in for a ride that handles well in everything from powder to crud. The Ride Magic Stick Snowboard is an enchanted quiver-killer that`s all about bringing durability, utility, and finesse wherever you go.', 5.5, 'Directional', '', 'Directional Hybrid Camber', '', 'Women`s Specific Performance Core', '', '', 'Carbon Array 3 Laminates ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', '', '', '', 'Roll-In Slimewall', '4x2', 0, 0, 1, 0, '2024-03-21 19:33:33', '2024-03-21 19:33:33'),
(116, '', 'Ride', 'Psychocandy', '2020', 'Ride Psychocandy 2020', 'ride-psychocandy-2020', 'Snowboard', '', 'Ride crafted the lady`s specific Ride Psychocandy Snowboard to ride like the Warpig and nail it in all conditions. This all-mountain killer is crafted with a directional rocker that`s playful and surfy while still remaining powerful and stable. Carbon Slimewalls and the new Women`s Performance Core give this board the gumption to handle heavy riding, serious turns in the deeps, and keep things fun and stable like a seasoned pro. The Ride Psychocandy Snowboard is one board for all your pow, groomer, and all-conditions needs. This board features a wider profile so for best results, size down from your standard board.', 5.5, 'Directional', '', 'Directional Flat', '', 'Women`s Specific Performance Core', '', 'Carbon Infused Glass', 'Carbon Array 5 Laminates ~ Double Impact Plates', '', 'Sintered, Stone Ground Base', 'Cleave Edge Steel', '', 'Topless Construction', 'Roll-In Slimewall ~ Carbon Slimewalls', '4x2', 0, 0, 1, 0, '2024-03-21 19:35:35', '2024-03-21 19:35:35'),
(117, '', 'Nitro', 'Cannon', '2020', 'Nitro Cannon 2020', 'nitro-cannon-2020', 'Snowboard', 'Quiver', 'When the Nitro The Quiver Cannon Snowboard first hit the shelves we joined the masses in gawking at its retro shape and massive length. The Cannon is the fastest board on the market, period. A part of the Nitro Quiver Series, this board is designed for the days when blasting through fresh powder and laying down some speed are at the top of your agenda. It`s made with a Cam-Out Camber and a surf-inspired swallowtail that keeps your control up, no matter the velocity.', 8, 'Directional', '', 'Directional Hybrid Camber', 'Cam-Out Camber', 'Power Core II', '', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-03-21 20:58:14', '2024-03-21 20:58:14'),
(118, '', 'Nitro', 'Slash', '2020', 'Nitro Slash 2020', 'nitro-slash-2020', 'Snowboard', 'Quiver', 'If you`ve got a rumblin` for some freshies that only a massive helping of powder can satisfy, then you need the Nitro The Quiver Slash Snowboard in your stash this year. A part of the Quiver series, this board hones in on Nitro`s 30 years of experience in the industry and creates a unique shape that`s an ode to the good ol` days of powder riding. Featuring a solid yet maneuverable Cam-Out Rocker and a tapered directional shape, this board throws down a surfy ride that`s fun and easy to ride.', 7, 'Directional', '', 'Directional Hybrid Camber', 'Cam-Out Camber', '3D Balsa Core', '', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-03-21 21:01:59', '2024-03-21 21:01:59'),
(119, '', 'Nitro', 'Fury', '2020', 'Nitro Fury 2020', 'nitro-fury-2020', 'Snowboard', 'Quiver', 'Notorious for its otherworldly angles and space-age design, the Nitro The Quiver Fury Snowboard has become a necessity to fun-loving earth Martians, and tree seeking nebulas alike. Made with a Cam-Out camber, this board displaces weight and keeps your nose from taking on snow and tracks well over everything in the mountain universe. One of the most asymmetrical-heavy boards on the market, this deck casts powerful turns on both your heel and toe side edge and makes it a dream when the powder gets thick. Don`t be an airhead, get the Fury in your quiver now!', 7, 'Twin', '', 'Hybrid Camber', 'Cam-Out Camber', 'Power Core II', 'Reflex Core Profile ', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', 'Power Pods', '', '', '4x2', 1, 0, 0, 0, '2024-03-21 21:07:50', '2024-03-21 21:07:50'),
(120, '', 'Nitro', 'Fusion', '2020', 'Nitro Fusion 2020', 'nitro-fusion-2020', 'Snowboard', 'Quiver', 'The Nitro The Quiver Fusion Snowboard gets its name from combining all the elements you love about your all-mountain board with a deck that`s meant for the depths of winter. An aggressive flex and a Cam-Out camber brings control and precision straight to your feet while maintaining a ride that`s still forgiving. With a durable Power Core II, this board`s lively wood core offers a smooth ride, tons of snap, and durability that rivals the best in the biz.', 7, 'Directional', '', 'Directional Hybrid Camber', 'Cam-Out Camber', 'Power Core II', 'Reflex Core Profile ', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', 'Power Pods', '', '', '4x2', 0, 0, 0, 0, '2024-03-21 21:12:12', '2024-03-21 21:12:12'),
(121, '', 'Nitro', 'Banker', '2020', 'Nitro Banker 2020', 'nitro-banker-2020', 'Snowboard', 'Quiver', 'Clear your shelf because the Banker was engineered to bring home some hardware. The new Quiver Bankers shape, sintered base, and responsive core, will help you fly through banked turns with ease and power, making it the fastest board in the Quiver Series.\nThe new Quiver Banker Snowboard was specifically designed to go fast in and out of banked slaloms no matter what mountain range you find yourself racing in. For years Bryan and Austin have wanted a board that will be their go to banked slalom board and this is what we have engineered - a board so powerful and fast you will need a strap for your hat. The Directional and Mid-Wide shape will allow you to really lay into those turns, while the Tre Camber and Sintered Speed Formula II Base will provide you with speed and power right out of the gates. If you are looking for a everyday all-mountain speed machine with a passion for banks slaloms than the Banker was designed to help you go faster than you have ever imagined!', 8, 'Directional', '', 'Full Camber', 'Tre Camber', 'Power Core II', 'Reflex Core Profile ', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-03-23 16:33:28', '2024-03-23 16:33:28'),
(122, '', 'Nitro', 'Pow', '2020', 'Nitro Pow 2020', 'nitro-pow-2020', 'Snowboard', 'Quiver', 'If you`re looking to hang ten off the ol` Peak 8, then chances are you want the Nitro The Quiver POW Snowboard in your arsenal. It`s crafted with Nitro`s TRE Camber, which is notorious for providing stability and pop that others just can`t handle. With a slightly more aggressive flex and a progressive sidecut that tapers into a sweet swallowtail, this board lets you surf the whole mountain while staying maneuverable and fun in the trees.', 7, 'Directional', '', 'Full Camber', 'Tre Camber', 'Power Core', '', '', 'Bi-Lite Laminates', '', 'Premium Extruded FH Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-03-23 16:45:55', '2024-03-23 16:45:55'),
(123, '', 'Nitro', 'Fintwin', '2020', 'Nitro Fintwin 2020', 'nitro-fintwin-2020', 'Snowboard', 'Quiver', 'The Nitro The Quiver Fintwin Snowboard is the all-new addition to the infamous Nito Quiver Series. Shorter, wider, and more playful than its predecessors, the Fintwin features a super-wide waist width and a natural setback to make this board agile in deep snow and groomers. With a stiffer all-terrain flex rating, the Fintwin doesn`t compromise on power and response, but remains versatile enough to take anywhere.', 7, 'Directional', '', 'Directional Hybrid Camber', 'Cam-Out Camber', 'Power Core', '', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula II Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-03-23 16:50:40', '2024-03-23 16:50:40'),
(124, '', 'Nitro', 'Doppelgnger', '2020', 'Nitro Doppelgnger 2020', 'nitro-doppelgnger-2020', 'Splitboard', '', 'The Doppelgngers Koroyd Powercore reduces the overall weight allows you to easily set the skin track to the top and go further on your next run and get to those untouched pow fields with energy to spare for another bucket list pow run with ease.\nThe Doppelgnger split boards lightweight Koroyd Powercore allows you to hike faster and further, while the Diamond Laminates provide the snap and support you want for steep faces and the Forged T7075 Aluminum Hooks provide peace of mind as you charge down untouched pow fields with stability and confidence. The Doppelgngerss Hike Pods will get you to the unmarked and distant powder with better edge grip on the way, while the Cam-Out Camber and Directional Mid-Wide shape will give you the float and reliable precision to navigate any terrain on the way down. The new and improved tip and tail locks are easy to get on and off with gloves on, which makes the transition process on cold peaks quicker and more enjoyable. This lightweight powerhouse now comes pre-drilled for a faster and more secure skin mounting procedure with the new custom Nitro x Kohla hiking skins. Reduce the weight of your overall split set-up without sacrificing durability and performance this winter with the new and improved Doppelgnger splitboard  hopefully, this will help you get OFFLINE and enjoy real life once again!Pre-drilled for fast and secure mounting of our custom Nitro x Kohla hiking skins.', 7, 'Directional', '', 'Directional Hybrid Camber', 'Cam-Out Camber', 'Koroyd / Powerlite Core', '', '', 'Diamond Laminates', '', 'Sintered Speed Formula HD Base', '', 'Hike Pods', '', '', 'Voil Insert Pattern', 0, 0, 0, 0, '2024-03-23 17:00:29', '2024-03-23 17:00:29'),
(125, '', 'Nitro', 'Squash Split', '2020', 'Nitro Squash Split 2020', 'nitro-squash-split-2020', 'Splitboard', '', 'Fast climbing and smooth on the way down, the Nitro Squash Splitboard is a great option for riders looking to make the most out of ever-changing backcountry conditions. TRE Camber and an agressive flex make the Squash Split stable and poppy, a powerful board for riders who know how to use it.', 7, 'Directional', '', 'Directional Camber', 'Tre Camber', 'Powerlite Core', '', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', 'Voil Insert Pattern', 0, 0, 0, 0, '2024-03-23 17:05:44', '2024-03-23 17:05:44'),
(126, '', 'Nitro', 'Nomad Split', '2020', 'Nitro Nomad Split 2020', 'nitro-nomad-split-2020', 'Splitboard', '', 'Leave the crowds at the resort behind and find your own line in the backcountry with the Nitro Nomad Splitboard. With a Voile and Spark-compatible insert patterns and included hooks, the Nomad will get you well on your way to exploring the mountains beyond the resort, and it comes at a price that rivals most park boards. The Flatout Rocker profile is flat with early-rise tips for a catch-free ride in powder that still packs plenty of edge hold and stability.\nUsing tip-to tail poplar wood in the Powercore core, this board provides lightweight strength paired with a flexible, responsive feel. It`s also equipped with Nitro`s new Power Pods, which extend the width of the board under the bindings to eliminate toe drag and create additional contact points for better edge hold on icy patches. New forged aluminum hooks offer a secdure hold and help prevent the two halves from having minds of their own when you`re enjoying the descent. Bi-Lite laminates keep the flex smooth for consistent carves while maintaining enough stiffness to let you point it down steeps. And it`s finished off with a premium FH extruded base that`s easy to repair if you ding it up on hidden rocks.', 6, 'Directional', '', 'Directional Flat', 'Flat-Out Camber', 'Power Core', '', '', 'Bi-Lite Laminates', '', 'Premium Extruded FH Base', '', 'Power Pods', '', '', 'Voil Insert Pattern', 0, 0, 0, 0, '2024-03-23 17:17:52', '2024-03-23 17:17:52'),
(127, '', 'Nitro', 'Highlander', '2020', 'Nitro Highlander 2020', 'nitro-highlander-2020', 'Snowboard', '', 'The Highlanders exclusive KOROYD core, makes this Nitro`s lightest and most comfortably responsive deck in the whole Nitro lineup  bundled up in a beautifully shaped directional powerhouse. Nitro`s most performance driven snowboard, built to be lighter, faster, and more responsive than anything you have ever experienced. The KOROYD core technology reduces the overall weight and absorbs chatter like nothing else, while the TRE Camber and Diamond Laminates provide unparalleled response and precision. Nitro`s Power Pods allow for high-speed turns and supreme edge hold on any snow condition.', 8, 'Directional', '', 'Full Camber', 'Tre Camber', 'Excelusive Koroyd Core', '', '', 'Diamond Laminates', '', 'Sintered Speed Formula II Base', '', 'Power Pods', '', '', '4x2', 0, 0, 0, 0, '2024-03-23 17:21:53', '2024-03-23 17:21:53'),
(128, '', 'Nitro', 'Superteam', '2020', 'Nitro Superteam 2020', 'nitro-superteam-2020', 'Snowboard', '', 'In terms of velocity, the Nitro Suprateam Snowboard 2020 is the speed demon of the snowboarding world. Made with the gold standard of Tre Camber and an aggressive flex rating, this board brings predictability and precision to all high-speed pursuits. With a twin shape, wider width, and progressive sidecut, the Suprateam works no matter where you take it.', 8, 'Directional Twin', '', 'Full Camber', 'Tre Camber', 'Powerlite Core', 'Reflex Core Profiling', '', 'Diamond Laminates', '', 'Sintered Speed Formula II Damast Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-03-23 17:24:57', '2024-03-23 17:24:57'),
(129, '', 'Nitro', 'Woodcarver', '2020', 'Nitro Woodcarver 2020', 'nitro-woodcarver-2020', 'Snowboard', '', 'The Nitro Woodcarver Snowboard epitomizes contemporary snowboard design - a classic Cam-Out Camber profile and Dual Degressive sidecut combine with the tapered profile and carbon reinforcements for a board that loves to carve, both on and off-piste - without being afraid of taking it to the terrain park. Designed for the modern-day rider who`s looking for a directional twin that doesn`t shy away from riding switch but really thrives nose-first, the Woodcarver will maximize your ride days no matter the forecast.', 7, 'Directional', '', 'Hybrid Camber', 'Cam-Out Camber', 'Powerlite Core', 'Reflex Core Profiling', '', 'Diamond Laminates', '', 'Sintered Speed Formula II Damast Base', '', 'Powder Pods', '', '', '4x2', 0, 0, 0, 0, '2024-04-11 17:16:53', '2024-04-11 17:16:53');
INSERT INTO `SkiBoards` (`skiboard_id`, `url`, `brand`, `model`, `year`, `name`, `slug`, `category`, `family`, `description`, `stiffness`, `shape`, `flex_profile`, `camber_profile`, `camber_details`, `core`, `core_profiling`, `fibreglass`, `laminates`, `resin`, `base`, `edges`, `edge_tech`, `topsheet`, `sidewall`, `inserts`, `asym`, `weight`, `womens`, `youth`, `created`, `updated`) VALUES
(130, '', 'Nitro', 'Santoku', '2020', 'Nitro Santoku 2020', 'nitro-santoku-2020', 'Snowboard', '', 'The utility knife of the snowboarding world, the all-new Nitro Santoku Snowboard is a do-anything utility tool that`s ready to rock your world. Rocking the classic Tre Camber profile for stability and predictability with one of the stiffest flex ratings on the market, the Santoku slices through even the most tracked out chunder with ease. With its snappy Powerlite core and carbon reinforcement, the Santoku is a powerful board that is made for riding fast.', 7, 'Directional Twin', '', 'Full Camber', 'Tre Camber', 'Powerlite Core', 'Whiplash Core Profiling', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula II Base', '', 'Powder Pods', 'Diamond V-Tips', '', '4x2', 0, 0, 0, 0, '2024-04-11 17:30:18', '2024-04-11 17:30:18'),
(131, '', 'Nitro', 'Pantera', '2020', 'Nitro Pantera 2020', 'nitro-pantera-2020', 'Snowboard', '', 'A legacy that represents all the bad asses in snowboarding, built for the guys looking for speed, precision, and unparalleled performance to push their limits every run. With years of experience under its belt the Pantera is the definition of heritage and good old fashion TRE Camber performance. This all-mountain icon has just been upgraded to be even faster with the new Sintered Speed Formula II Damast Base. If you are looking for a board designed for speed, precision, and the worlds most powerful turn  look no further than the Pantera!', 9, 'Directional', '', 'Full Camber', 'Tre Camber', 'Powerlite Core', 'Reflex Core Profiling', '', 'Diamond Band ~ Bi-Lite Laminates', '', 'Sintered Speed Formula II Damast Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-11 17:37:11', '2024-04-11 17:37:11'),
(132, '', 'Nitro', 'Mountain', '2020', 'Nitro Mountain 2020', 'nitro-mountain-2020', 'Snowboard', '', 'The gold standard of classic directional shapes from Nitro, the Nitro Mountain Snowboard features Cam-Out Camber and a Progressive Sidecut, making it a pinner profile that`s smooth in the transitions and a total edge to edge rocket. With an all-terrain flex and snappy Power Core II, the Mountain Snowboard is a precision ride you can count on in all conditions.', 7, 'Directional', '', 'Directional Hybrid Camber', 'Cam-Out Camber', 'Powercore II', '', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-11 17:43:00', '2024-04-11 17:43:00'),
(133, '', 'Nitro', 'Mountain x Grif', '2020', 'Nitro Mountain X Grif 2020', 'nitro-mountain-x-grif-2020', 'Snowboard', '', 'Inspired by Griffin Seibert`s home state of Utah, the Nitro Mountain x Griff Snowboard is crafted for variable conditions. Featuring a Cam-Out Camber, this classic profile is upgraded with early transitions in the tip and tail making it responsive, forgiving, and ridiculously stable. The tapered directional shape is crafted around an aggressive flexing Power Core and handles high speeds with poise. A do it all board with a calling for big and burly terrain, the Nitro Mountain x Griff Snowboard is designed for aggressive riders looking to cover the entire mountain with one deck.', 7, 'Directional', '', 'Directional Hybrid Camber', 'Cam-Out Camber', 'Powercore II', '', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-11 17:45:17', '2024-04-11 17:45:17'),
(135, '', 'Nitro', 'Squash', '2020', 'Nitro Squash 2020', 'nitro-squash-2020', 'Snowboard', '', 'The Nitro Squash Snowboard has been a bonafide crowd-pleaser since its debut. The ultimate do anything board, the Squash tackles all-mountain missions, powder excursions, and banked slalom sessions with a balanced blend of style meets ease. Tre Camber ensures ample stability and responsiveness, while a tapered swallow tail makes it surfy and seriously fun in fresh conditions. Get after anything with the Squash in your quiver!', 7, 'Directional', '', 'Directional Hybrid Camber', 'Cam-Out Camber', 'Powercore II', '', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-11 17:50:32', '2024-04-11 17:50:32'),
(136, '', 'Nitro', 'Team Exposure', '2020', 'Nitro Team Exposure 2020', 'nitro-team-exposure-2020', 'Snowboard', '', 'What we love most about the Nitro Team Exposure Snowboard is that there`s nothing else like it on the hill. It showcases a series of photos from a team trip to the Lofoten Islands well above the arctic circle, a reminder to `Run to the Hills` and get out there this season! This beautiful piece is crafted with Tre camber and has a precise and powerful ride feel that is suitable for all terrain charging. Whether you hang it up as art or mount it up and throw down -- the Team Exposure is a beautiful board that`ll elicit smiles no matter where you take it.', 7, 'Directional Twin', '', 'Full Camber', 'Tre Camber', 'Powerlite Core', 'Reflex Core Profiling', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-11 17:51:25', '2024-04-11 17:51:25'),
(137, '', 'Nitro', 'Team Exposure Gullwing', '2020', 'Nitro Team Exposure Gullwing 2020', 'nitro-team-exposure-gullwing-2020', 'Snowboard', '', 'What we love most about the Nitro Team Exposure Snowboard is that there`s nothing else like it on the hill. It showcases a series of photos from a team trip to the Lofoten Islands well above the arctic circle, a reminder to `Run to the Hills` and get out there this season! This beautiful piece is crafted with Tre camber and has a precise and powerful ride feel that is suitable for all terrain charging. Whether you hang it up as art or mount it up and throw down -- the Team Exposure is a beautiful board that`ll elicit smiles no matter where you take it.', 6, 'Directional Twin', '', 'Hybrid Rocker', 'Gullwing Rocker', 'Powerlite Core', 'Reflex Core Profiling', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-11 17:58:53', '2024-04-11 17:58:53'),
(138, '', 'Nitro', 'Team Gullwing', '2020', 'Nitro Team Gullwing 2020', 'nitro-team-gullwing-2020', 'Snowboard', '', 'The legacy runs deep with our most trusted all terrain snowboard, the Team Gullwing version, which offers a playful, effortless and forgiving ride for all styles in any condition on any terrain.\nAdding the playful, forgiving, and reliable Gullwing Rocker to the legendary Directional Twin Team snowboard allows anyone to turn their local mountain into the ultimate private playground. Stacked with the same technology as the standard team but designed to provide the perfect blend of response and forgiveness for effortless progression and surf like feel no matter the conditions. The standard camber strategically placed under the feet provides the pop and response you need for lazer-control, while the reverse camber between the bindings offers the most amazing flex and float for presses and pow days.', 6, 'Directional Twin', '', 'Hybrid Rocker', 'Gullwing Rocker', 'Powerlite Core', 'Reflex Core Profiling', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-11 18:12:36', '2024-04-11 18:12:36'),
(139, '', 'Nitro', 'Team', '2020', 'Nitro Team 2020', 'nitro-team-2020', 'Snowboard', '', 'Offering well over a decade of reliable all-mountain domination, the Nitro Team is our most trusted versatile all-terrain snowboard loved by weekend warriors to pros all over the world!\nThe Team has been the most trust worthy and iconic snowboard in our line for well over a decade; continuous innovation and a perfect blend of flex and response has been the key to its success. Our Tre Camber offers the perfect amount of standard camber for reliable snap and riding with confidence, while the Reflex Core Profile offers a playful and yet responsive flex. Team riders like Sam Taxwood, Ludvig Billtoft, and Victor De Le Rue who ride the entire mountain from the park, halfpipe, to the steepest of AK lines, always choose the versatility of the Team snowboard as their all-mountain slayer.', 7, 'Directional Twin', '', 'Full Camber', 'Tre Camber', 'Powerlite Core', 'Reflex Core Profiling', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-11 18:13:58', '2024-04-11 18:13:58'),
(140, '', 'Nitro', 'Dropout', '2020', 'Nitro Dropout 2020', 'nitro-dropout-2020', 'Snowboard', '', 'New to the Carver Cre Series, the Nitro Dropout Snowboard is handcrafted for churning out some lofty turns and having a good time all over the mountain. The Cam-Out Camber takes a classic shape and throws in some smooth transitions in the tip and tail, making this board ideal for heavy powder and deep days in the bowl while a lightweight core handles your inbounds rips. Whenever you go, the Dropout is the ideal stick to make the most out of your time on the mountain.', 7, 'Directional', '', 'Directional Hybrid Camber', 'Cam-Out Camber', 'Powercore', 'Reflex Core Profiling', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-11 18:18:39', '2024-04-11 18:18:39'),
(141, '', 'Nitro', 'Magnum', '2020', 'Nitro Magnum 2020', 'nitro-magnum-2020', 'Snowboard', '', 'A large foot should not be a limitation to progression, and the Magnum makes sure of this by offering a perfect blend of support, response, and flex to allow you to continue to step your game up all over the mountain. Designed to feel like a standard width snowboard, the Nitro Magnum is a wide board that turns and rides effortlessly in pow and hard-pack with precision. The new Directional shape allows for more float in pow, while the new Dual Degressive sidecut and new Power Pods provide a turning sensation that you have never experienced before. Good bye heel and toe drag  Hello armpit to the ground carves!', 7, 'Directional', '', 'Directional Hybrid Camber', 'Cam-Out Camber', 'Powercore Lite', 'Reflex Core Profiling', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', 'Power Pods', '', '', '4x2', 0, 0, 0, 0, '2024-04-13 17:43:51', '2024-04-13 17:43:51'),
(142, '', 'Nitro', 'SMP', '2020', 'Nitro Smp 2020', 'nitro-smp-2020', 'Snowboard', '', 'Built for those snowboard adventurists and day dreamers to take this board and create their own path down any marked or unmarked trail in search of the next greatest run.\nDesigned to give you an alternative to more traditional shapes and provide the support and technology to conquer anything in your path with style and ease. The combination of Cam-Out Camber and Directional set back shape allows you to descend the steepest of runs with ease, while the early rise in the nose and tail offer a forgiving surf-like float. The Sintered Speed Formula HD Base will give you plenty of speed to escape the wild animals you might encounter while you are exploring the unknown.', 7, 'Directional', '', 'Directional Hybrid Camber', 'Cam-Out Camber', 'Powercore', '', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-13 17:53:52', '2024-04-13 17:53:52'),
(143, '', 'Nitro', 'Cinema', '2020', 'Nitro Cinema 2020', 'nitro-cinema-2020', 'Snowboard', '', 'The Cinemas new Directional Twin shape is perfect for diving into your local mountain and exploring the entire trail map, while effortlessly creating your own progression path and memories by using the performance friendly-ride of the Nitro Cinema.\nThe Cinemas new Directional Twin shape was developed to provide the perfect blend of sidecut, flex, and forgiveness to help you learn faster from the groomers to the park. Built to be a perfect go to all mountain explorer with a flex that is softer and more fun, thanks to its Gullwing Rocker and Park Flex. Developed to offer the stability and catch-free ride needed for experienced riders to quickly learn new tricks in the park, while offering enough forgiveness for beginners to easily learn how to link turns on the groomers.', 5, 'Directional', '', 'Hybrid Rocker', 'Gullwing Rocker', 'Powercore II', '', '', 'Bi-Lite Laminates', '', 'Premium Extruded FH Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-13 18:00:57', '2024-04-13 18:00:57'),
(144, '', 'Nitro', 'Prime Overlay', '2020', 'Nitro Prime Overlay 2020', 'nitro-prime-overlay-2020', 'Snowboard', '', 'The Nitro Prime Overlay Snowboard is made to help take the learning curve and shrink it. Catch-free, Flat Out Rocker cruises down hillsides smoothly and helps you link turns together more naturally. That means friendlier progression and a feel that works for all skill levels. Crush laps in the park, explore the resort, and up your game with the Nitro Prime Overlay Snowboard.', 5, 'Directional', '', 'Flat', 'Flat-Out Rocker', 'Powercore', '', '', 'Bi-Lite Laminates', '', 'Premium Extruded FH Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-13 18:06:15', '2024-04-13 18:06:15'),
(145, '', 'Nitro', 'Prime Screen', '2020', 'Nitro Prime Screen 2020', 'nitro-prime-screen-2020', 'Snowboard', '', 'Quit analyzing and start riding! The Nitro Prime Screen Snowboard is made for riders who`d rather spend their time out on the hill perfecting their turns than worrying about which type of sidecut will help them best. With a directional shape that welcomes progression, this board is fun no matter where you ride it. A slightly set back stance and Nitro`s catch-free Flat-Out Rocker profile keeps you riding with confidence, helping your skills advance each time you strap it on. This board is great if you`re just starting your snowboarding career, but it`s not just for beginners: it`s a playful all-mountain board for anyone looking for a predictable and fun ride.', 5, 'Directional', '', 'Flat', 'Flat-Out Rocker', 'Powercore', '', '', 'Bi-Lite Laminates', '', 'Premium Extruded FH Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-13 18:09:01', '2024-04-13 18:09:01'),
(146, '', 'Nitro', 'Beast', '2020', 'Nitro Beast 2020', 'nitro-beast-2020', 'Snowboard', '', 'The Nitro Beast Snowboard was designed in collaboration with four of the best freestyle snowboarders in the world, and all four of them use it as their pro model for everything from video parts to Olympic super park runs. It`s a classic park deck shape with true camber, a park specific flex pattern, and a single radius sidecut, but the construction has been majorly beefed up to provide maximum power and stompability. The extra snappy poplar and beech core is reinforced with Kevlar impact panels and carbon stringers to make the board stiffer and more bomber to keep up with Marcus, Eero, Torgier, and Sven`s rowdy pro-level antics.', 8, 'Twin', '', 'Full Camber', 'Tre Camber', 'Powercore II', 'Whiplash Core Profiling', '', 'Tri-Lite Laminates ~ Balistic Impact Panels ~ Diamond Band', '', 'Sintered Speed Formula II Base', 'Railkiller Edge', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-14 04:18:21', '2024-04-14 04:18:21'),
(147, '', 'Nitro', 'Beast x Volcom', '2020', 'Nitro Beast X Volcom 2020', 'nitro-beast-x-volcom-2020', 'Snowboard', '', 'Nitro and Volcom have been working together since the days of flip phones and Tamagotchi. With a decade of pow hunts, park laps, and road trips under their belts, it was only a matter of time before a snowboard was released to salute these years of camaraderie. The Nitro Beast x Volcom Snowboard features Nitro`s TRE Camber and Power Core II for loaded pop and play in and out of the terrain park. Keep the good times rollin` and get your feet on the Nitro Beast x Volcom Snowboard!', 8, 'Twin', '', 'Full Camber', 'Tre Camber', 'Powercore II', 'Whiplash Core Profiling', '', 'Tri-Lite Laminates ~ Balistic Impact Panels ~ Diamond Band', '', 'Sintered Speed Formula II Base', 'Railkiller Edge', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-14 04:20:23', '2024-04-14 04:20:23'),
(148, '', 'Nitro', 'T1', '2020', 'Nitro T1 2020', 'nitro-t1-2020', 'Snowboard', '', 'From off-piste sends to park take-offs, the Nitro T1 Snowboard is all about getting a little sendy. It`s made with Nitro`s Cam-Out Camber, which brings together a classic twin shape with buttery smooth turn initiation - fun and forgiving, and specifically tuned with Nitro`s park flex for snappy freestyle fun all over the mountain.', 6, 'Twin', '', 'Hybrid Camber', 'Cam-Out Camber', 'Powercore II', 'Whiplash Core Profiling', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', 'Railkiller Edge', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-14 04:22:39', '2024-04-14 04:22:39'),
(149, '', 'Nitro', 'SHtik', '2020', 'Nitro Shtik 2020', 'nitro-shtik-2020', 'Snowboard', '', 'Let your progression in the park accelerate with this freestyle twin, softer flexing, cam-out camber snowboard powerhouse, offering the flex you need for learning new tricks without sacrificing the support you need to land like a pro.\nFor the freestyle enthusiast in search of a softer flexing camber board without sacrificing top-shelf performance that will progress with them season after season. Engineered for fun snowboarding by combining Cam-Out Camber, Whiplash Core Profile, and a Twin shape that allows riders of all levels to get their presses sky-high, and stomp landings all day long in style. The Dual Degressive sidecut allows you to carve with style and ease from feature to feature, side hit to side hit, and the durability of the RailKiller Edges and Powercore II will keep you charging day after day!', 5, 'Twin', '', 'Hybrid Camber', 'Cam-Out Camber', 'Powercore II', 'Whiplash Core Profiling', '', 'Bi-Lite Laminates', '', 'Premium Extruded FH Base', 'Railkiller Edge', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-14 04:24:44', '2024-04-14 04:24:44'),
(150, '', 'Nitro', 'Cheap Thrills', '2020', 'Nitro Cheap Thrills 2020', 'nitro-cheap-thrills-2020', 'Snowboard', '', 'Let your imagination loose in the park, and let your riding speak for itself with the new Nitro Cheap Thrills pro-caliber freestyle snowboard. Designed for those who see the mountain, park, or streets as a blank canvas and want to create their own lines through the chaos.\nWe are proud to introduce the newest freestyle snowboard to our ever-evolving snowboard line, the Nitro Cheap Thrills. Design and engineered to be the most versatile medium flexing park board on the mountain, with its Flat-Out Rocker allowing for a trick-oriented ride, while the Whiplash Core Profile provides the stability and snap needed for sending it from feature to feature. The Railkiller Edges are twice as thick and twice as strong as a standard edge allowing you to go even harder in the park without worrying about your edges, and the Premium Extruded FH Base is durable, fast and easy to maintain. The Cheap Thrills trippy and colorful graphic direction sparked a collaboration with the world-renowned art supplies brand Faber-Castell, which resulted in each board coming with a free set of four high-quality Faber-Castell neon colored marker pens and black and white mini poster with the Cheap Thrills graphic , so you can get trippy and color your own version.', 5, 'Twin', '', 'Flat', 'Flat-Out Camber', 'Powercore II', 'Whiplash Core Profiling', '', 'Bi-Lite Laminates', '', 'Premium Extruded FH Base', 'Railkiller Edge', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-14 04:31:44', '2024-04-14 04:31:44'),
(151, '', 'Nitro', 'Volta', '2020', 'Nitro Volta 2020', 'nitro-volta-2020', 'Splitboard', '', 'Do what you have always dreamed of doing ditch the lift lines and use this user-friendly splitboard to go explore what the mountain really has to offer, with control and ease on the way up and full style and confidence on the way down.\nThe Volta offers affordable access to the freedom, adventures, and workout that you will experience through splitboarding. The Voltas Flat-Out Rocker allows you to blast through the learning curve with effortless float, while the Power Pods offer the needed support and response for getting up and down the mountain. Leave the chairlift and day ticket behind and experience the purity of endless adventure snowboarding with the Nitro Womens Volta Splitboard.', 5, 'Directional', '', 'Flat', 'Flat-Out Camber', 'Powercore', '', '', 'Bi-Lite Laminates', '', 'Premium Extruded FH Base', '', 'Power Pods', '', '', 'Voil Insert Pattern', 0, 0, 1, 0, '2024-04-14 04:37:59', '2024-04-14 04:37:59'),
(152, '', 'Nitro', 'Victoria', '2020', 'Nitro Victoria 2020', 'nitro-victoria-2020', 'Snowboard', '', 'This directional board is the most responsive and powerful women`s specific deck in the Nitro lineup. The Victoria is designed to get you there faster, more stable and with more confidence. This is the true all mountain board you`ve been waiting for.', 7, 'Directional', '', 'Full Camber', 'Tre Camber', 'Koroyd Core', 'Reflex Core Profile', '', 'Diamond Laminates', '', 'Sintered Speed Formula II Base', '', '', '', '', '4x2', 0, 0, 1, 0, '2024-04-14 04:45:01', '2024-04-14 04:45:01'),
(153, '', 'Nitro', 'Drop', '2020', 'Nitro Drop 2020', 'nitro-drop-2020', 'Snowboard', '', 'The Nitro Drop Snowboard features an all-mountain contour with a penchant for powder and fresh lines. Its directional shape, radial sidecut, and Cam-Out Camber make the Drop buttery smooth no matter the snow conditions, sufficiently responsive in more technical terrain, yet forgiving when you need it most. Whether you`re ripping inbounds terrain or ducking the tape -- the Drop can handle it all.', 6, 'Directional', '', 'Hybrid Camber', 'Cam-Out Camber', 'Powercore', '', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', 'Power Pods', '', '', '4x2', 0, 0, 1, 0, '2024-04-14 05:12:31', '2024-04-14 05:12:31'),
(154, '', 'Nitro', 'Fate', '2020', 'Nitro Fate 2020', 'nitro-fate-2020', 'Snowboard', '', 'Designed specifically to offer a familiar ride in any condition on any terrain through a responsive, yet forgiving cam-out camber, and a perfect blend of sidecut and flex to give you the feeling that anything is possible and fate is in your hands!\nExperience and innovation has defined the womens Nitro Fate series for years now, and its award-winning ride and performance continues to impress year after year. The Fate is hands down our most trusted & versatile womens deck equipped with Cam-Out Camber for more liveliness, support, and control, while the Powerlite Core and Dual Degressive Sidecut allow you to effortlessly progress your style, confidence and speed every day on the mountain. The Nitro Fate is the perfect match for aspiring contest pros or just those shredders who demand the best and a versatile board that will last!', 5, 'Directional Twin', '', 'Hybrid Camber', 'Cam-Out Camber', 'Powerlite', 'Refelx Core Profiling', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 1, 0, '2024-04-14 05:23:50', '2024-04-14 05:23:50'),
(155, '', 'Nitro', 'Mystique', '2020', 'Nitro Mystique 2020', 'nitro-mystique-2020', 'Snowboard', '', 'Mystify the masses with a board that delivers all-mountain magic. The Nitro Mystique Snowboard features a Gullwing Rocker profile that combines the best of camber and rocker profiles for a floaty ride in powder and precise ride in the park. With a responsive all-terrain flex pattern that`s surfy in the soft stuff and poppy when you want to have some fun, you`ll quickly fall under this board`s charm.', 5, 'Directional Twin', '', 'Hybrid Rocker', 'Gullwing Rocker', 'Powerlite', 'Refelx Core Profiling', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 1, 0, '2024-04-14 05:28:35', '2024-04-14 05:28:35'),
(156, '', 'Nitro', 'Lectra', '2020', 'Nitro Lectra 2020', 'nitro-lectra-2020', 'Snowboard', '', 'From riders just getting their footing to pros looking for a softer board to take in the park, the Nitro Lectra Snowboard is a killer board that suits a wide range of ability levels and riding styles. Made with a Flat Out Rocker that blends the best of rocker and camber, this is a responsive and catch-free ride that thrives from top to bottom of the mountain.', 3, 'Directional Twin', '', 'Flat', 'Flat-Out Camber', 'Powercore', '', '', 'Bi-Lite Laminates', '', 'Premium Extruded FH Base', '', '', '', '', '4x2', 0, 0, 1, 0, '2024-04-14 05:35:34', '2024-04-14 05:35:34'),
(157, '', 'Nitro', 'Mercy', '2020', 'Nitro Mercy 2020', 'nitro-mercy-2020', 'Snowboard', '', 'Developed together with top pro girls like to make a women`s twin freestyle snowboard that offers the confidence and support needed to allow for comfortable progression in any park world wide./nOur most responsive women`s twin freestyle snowboard designed to offer the perfect response and liveliness for all day hot laps in the park, to record-breaking speeds down the steeps. The Cam-Out Cambers underfoot foot camber with early rocker rise in the nose and tail offers the snap and response you want to hit the features in the park, without sacrificing the flex and forgiveness you need for friendly progression and sky-high presses. The Railkiller Edges allow you to take this freestyle shred stick to the rails and boxes all season long without having to worry, so follow some of the best female snowboarders in the world this season and learn something new.', 4, 'Twin', '', 'Hybrid Camber', 'Cam-Out Camber', 'Powercore II', '', '', 'Bi-Lite Laminates', '', 'Premium Extruded FH Base', 'Railkiller Edge', '', '', '', '4x2', 0, 0, 1, 0, '2024-04-14 05:40:07', '2024-04-14 05:40:07'),
(158, '', 'Nitro', 'Squash Youth', '2020', 'Nitro Squash Youth 2020', 'nitro-squash-youth-2020', 'Snowboard', '', 'The Nitro Squash Snowboard has been a bonafide crowd-pleaser since its debut, now available for the mini-shredders among us! The ultimate do anything board, the Squash tackles all-mountain missions, powder excursions, and banked slalom sessions with a balanced blend of style meets ease. Tre Camber ensures ample stability and responsiveness, while a tapered swallow tail makes it surfy and seriously fun in fresh conditions. Get after anything with the Squash in your quiver!', 5, 'Directional', '', 'Full Camber', 'Tre Camber', 'Powercore II', '', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 1, '2024-04-14 05:53:33', '2024-04-14 05:53:33'),
(159, '', 'Nitro', 'Future Team', '2020', 'Nitro Future Team 2020', 'nitro-future-team-2020', 'Snowboard', '', 'The Nitro Squash Snowboard has been a bonafide crowd-pleaser since its debut, now available for the mini-shredders among us! The ultimate do anything board, the Squash tackles all-mountain missions, powder excursions, and banked slalom sessions with a balanced blend of style meets ease. Tre Camber ensures ample stability and responsiveness, while a tapered swallow tail makes it surfy and seriously fun in fresh conditions. Get after anything with the Squash in your quiver!', 5, 'Twin', '', 'Hybrid Camber', 'Cam-Out Camber', 'Powercore', '', '', 'Bi-Lite Laminates', '', 'Sintered Speed Formula HD Base', '', '', '', '', '4x2', 0, 0, 0, 1, '2024-04-14 06:07:02', '2024-04-14 06:07:02'),
(160, '', 'Nitro', 'Arial', '2020', 'Nitro Arial 2020', 'nitro-arial-2020', 'Snowboard', '', 'The Arials catch-free Cam-Out Camber and Powercore offer a more responsive ride for the girls who are ready to ride every run on the mountain in search for the next pow stash, side-hit, or park jump.\nThe Arial has been designed and engineered specifically for girls looking for a progression-friendly snowboard that will help them take their first step into the world of bigger snowboards and responsive cambers. The Arials Cam-Out Camber offers added support and response underfoot, and early lift off right before the contact points at tip and tail provide a more forgiving, catch-free ride in any conditions. The standard width and Radial Sidecut will allow you or your daughter to make surf like slashes all over the mountain with ease and finesse. Specifically designed to help girls continue their natural progression with confidence and a never-ending snowboard smile.', 3, 'Directional Twin', '', 'Hybrid Camber', 'Cam-Out Camber', 'Powercore', '', '', 'Bi-Lite Laminates', '', 'Premium Extruded FH Base', '', '', '', '', '4x2', 0, 0, 0, 1, '2024-04-14 06:10:29', '2024-04-14 06:10:29'),
(161, '', 'Nitro', 'Ripper Youth', '2020', 'Nitro Ripper Youth 2020', 'nitro-ripper-youth-2020', 'Snowboard', '', 'The Ripper is the most fun, forgiving, ultra-stable, and progression-friendly kids board on the market and has been engineered over many years to help any ripper take the next step in progressing in and out of the park with ease.\nDesigned to help young rippers start snowboarding and continue progressing until they can out ride their entire family any day of the week. The Flat-Out Rocker camber profile will provide the perfect natural flex for any sized shredder looking to press, jump, carve, spin, and laugh all the way down ever run. This true twin-tip board is the board of choice for youngsters looking to ride like the older kids! Congratulations your snowboarding adventures start here!', 2, 'Directional Twin', '', 'Flat', 'Flat-Out Camber', 'Powercore', '', '', 'Bi-Lite Laminates', '', 'Premium Extruded FH Base', '', '', '', '', '4x2', 0, 0, 0, 1, '2024-04-14 06:12:09', '2024-04-14 06:12:09'),
(162, '', 'United Shapes', 'Cadet', '2020', 'United Shapes Cadet 2020', 'united-shapes-cadet-2020', 'Snowboard', '', 'Launched with the brand in 2014, the United Shapes Cadet Snowboard has become a fast favorite of freeriders everywhere. Even though these boards are still rare, it`s become much less surprising to see strong riders standing on that basic black topsheet after blasting through a tight chute or laying the perfect line through pow-filled trees. The Cadet`s mission has remained unchanged over the years, but it`s seen refinements in materials and shape, helping it remain one of those flawless boards you can`t help but love.', 6, 'Directional', '', 'Directional Camber', '', 'A11X', '', 'Triax', 'Carbon Stringers', '100% VOC-Free Epoxy', 'Sintered P-Tex 4000', 'Steel', '', 'Direct-Print Topsheet', 'UHMW ABS Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-15 23:29:33', '2024-04-15 23:29:33'),
(163, '', 'United Shapes', 'Horizon', '2020', 'United Shapes Horizon 2020', 'united-shapes-horizon-2020', 'Snowboard', '', 'A day on a United Shapes Horizon Snowboard will open your mind as to what kind of rider you are--and really, has the ability to erase genres altogether. With traditional camber, a playful flex, and a centered stance, this board is right at home in the park, down to ride switch, spin, or press at the drop of a hat. When you head outside the confines of the manicured playground, though, it`s a capable all-mountain board too: it has a floaty nose, a maneuverable tapered tail, and the option to dump your bindings in the back seat for deep days. Get woke, stay stoked.', 5, 'Directional', '', 'Directional Camber', '', 'Paulownia / Balsa', '', 'Biax', 'Carbon Stringers ~ Carbon Spine', '100% VOC-Free Epoxy', 'Sintered P-Tex 4000', 'Steel', '', 'Direct-Print Topsheet', 'UHMW ABS Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-15 23:36:29', '2024-04-15 23:36:29'),
(164, '', 'United Shapes', 'Rover', '2020', 'United Shapes Rover 2020', 'united-shapes-rover-2020', 'Snowboard', '', 'The smallest in the Explorer line, the United Shapes Rover Snowboard was made to power around tight spaces. With a slight taper and a wide, early-rise nose, it`ll motor around zones looking for hidden chutes, tight lines, and open bowls. A backcountry board that plays well with others, it`s a daily driver for sneaky pow pilots.', 5, 'Directional', '', 'Directional Camber', '', '', '', 'Triax', 'Carbon Stringers ~ Flax', '100% VOC-Free Epoxy', 'Sintered P-Tex 4000', 'Steel', '', 'Direct-Print Topsheet', 'UHMW ABS Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-15 23:42:33', '2024-04-15 23:42:33'),
(165, '', 'United Shapes', 'Pioneer', '2020', 'United Shapes Pioneer 2020', 'united-shapes-pioneer-2020', 'Snowboard', '', 'Blaze new trails on the United Shapes Pioneer Snowboard, an all-mountain tool that`ll enhance your search into the unknown. With a playful flex and 4mm of camber, this tapered funstick can be set up centered for most riding, with the option to recline way back on those deeper days. When it`s not bottomless, the Pioneer has a smooth vibe all around, initiating turns well without losing the ability to go very fast in a straight line. So don your coonskin cap, mount up your favorite bindings, and head off into the great untracked.', 4, 'Directional', '', 'Directional Camber', '', '', '', 'Triax', 'Carbon Stringers ~ Flax', '100% VOC-Free Epoxy', 'Sintered P-Tex 4000', 'Steel', '', 'Direct-Print Topsheet', 'UHMW ABS Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-15 23:46:12', '2024-04-15 23:46:12'),
(166, '', 'United Shapes', 'Deep Reach', '2020', 'United Shapes Deep Reach 2020', 'united-shapes-deep-reach-2020', 'Snowboard', '', 'Put some tracks out there, way over there, on the United Shapes Deep Reach Snowboard. Designed with the big mountain rider in mind, this floaty linefinder has a nose for pow, but has no problem with crossing variable conditions on its way there. It has a medium flex that feels extra solid with the help of carbon stringers and traditional camber. It`s directional, but can handle a little bit of the ol` turnaround reverso riding with a slight kicktail and a manageable taper. Reach deep!', 6, 'Directional', '', 'Directional Camber', '', '', '', 'Triax', 'Carbon Stringers', '100% VOC-Free Epoxy', 'Sintered P-Tex 4000', 'Steel', '', 'Direct-Print Topsheet', 'UHMW ABS Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-15 23:51:04', '2024-04-15 23:51:04'),
(167, '', 'United Shapes', 'Voyager', '2020', 'United Shapes Voyager 2020', 'united-shapes-voyager-2020', 'Snowboard', '', 'An escape pod that`ll get you to Mars and back, the United Shapes Voyager Snowboard likes to lay solo tracks. Its traditional camber is backed up by a poppy wood core and carbon stringers, working with a 15mm taper to strike a nice balance between float, turning, and stability at speed. Consult a map, pack a lunch, and strike out on your quixotic snow epic: the Voyager is game.', 6, 'Directional', '', 'Directional Camber', '', '', '', 'Triax', 'Carbon Stringers ~ Flax', '100% VOC-Free Epoxy', 'Sintered P-Tex 4000', 'Steel', '', 'Direct-Print Topsheet', 'UHMW ABS Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-15 23:56:29', '2024-04-15 23:56:29'),
(168, '', 'United Shapes', 'Voyager', '2020', 'United Shapes Voyager 2020', 'united-shapes-voyager-2020', 'Snowboard', '', 'With a playful and versatile construction, you can expect a completely different kind of riding experience on new and old slopes alike aboard the United Shapes Experience Snowboard. With its 9mm of taper for floatation and a wide range of stance options, you`ll be prepared for anything that comes your way, from the peak to the park, pow to piste.', 5, 'Directional', '', 'Directional Camber', '', '', '', 'Triax', 'Carbon Stringers', '100% VOC-Free Epoxy', 'Sintered P-Tex 4000', 'Steel', '', 'Direct-Print Topsheet', 'UHMW ABS Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-16 00:02:49', '2024-04-16 00:02:49'),
(169, '', 'United Shapes', 'Orbit', '2020', 'United Shapes Orbit 2020', 'united-shapes-orbit-2020', 'Snowboard', '', 'The United Shapes Orbit Snowboard will take you to the edge. It`ll show you the edge. It`ll show you just how much edge a board can possibly have, thanks to its blunted nose and chop tail that does away with material that doesn`t help you cut into the snow. This board is all edge: a freecarver capable of tracing any arc you ask it to, at any speed. A stiff flex and traditional camber help make this so. Go ahead. Carve.', 8, 'Directional', '', 'Directional Camber', '', 'Orbit XII', '', 'Triax', 'Carbon Stringers ~ Carbon Spine', '100% VOC-Free Epoxy', 'Sintered P-Tex 4000', 'Steel', '', 'Direct-Print Topsheet', 'UHMW ABS Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-16 00:04:09', '2024-04-16 00:04:09'),
(170, '', 'United Shapes', 'Covert', '2020', 'United Shapes Covert 2020', 'united-shapes-covert-2020', 'Splitboard', '', 'The United Shapes Covert Splitboard is made to make the climb up as pain-free as possible, and the ride down always worthwhile. It`s lightweight and tough, with splitboard-specific construction features like an abrasion-resistant topsheet, a bulletproof sintered base, and traction-friendly traditional camber. When it`s in solid mode, it`s worthy of the United Shapes name, with a smooth, fun, and dependable ride. Offered in a wide range of lengths, the Covert is a tool for backcountry seekers of any size.', 6, 'Directional', '', 'Directional Camber', '', 'A11XSP', '', 'Triax', 'Carbon Spine', '100% VOC-Free Epoxy', 'Sintered P-Tex 4000', 'Steel', '', 'Structured Nylon Sublimated Topsheet', 'Urethane Sidewalls', 'Voil Insert Pattern', 0, 0, 0, 0, '2024-04-16 00:06:27', '2024-04-16 00:06:27'),
(171, '', 'Rome', 'Ravine', '2020', 'Rome Ravine 2020', 'rome-ravine-2020', 'Snowboard', '', 'The Rome Ravine Snowboard doesn`t lay trenches, it lays ravines. A big floaty nose leads into a directional camber shape for floating through deep froths of pow, with a deep sidecut for mimicking your favorite surfer while getting super sideways. The bamboo thruster configuration adds durable pop to your ride for more fun, more pop, and more giddy-up while shredding the gnar. The Rome Ravine Snowboard lives for pow days and rips every day. Put your foot on the gas and stomp a good one.', 6, 'Directional', '', 'Directional Camber', 'Free-The-Ride 3D Camber', 'Pop Core Matrix', '', '', 'Bamboo Thruster ~ 45/90 Hybrid Laminate', '', 'SinterTrue Base', '', '', '', 'Urethane Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-16 00:22:55', '2024-04-16 00:22:55'),
(172, '', 'Rome', 'National', '2020', 'Rome National 2020', 'rome-national-2020', 'Snowboard', '', 'So good you could write an anthem about it, the Rome National Snowboard is the ace daily driver that dedicated riders deserve. This carbon-spined alpha board is light, poppy, and built to shred like a cornered velociraptor so you can slash the steeps and search for adventure from peak to park and beyond. Its premium base is built to book it like you`re trying to get down the hill before they stop serving breakfast, while the versatile flex of the Rome National Snowboard is responsive and playful at the same time. Who says you need more than one board?', 6, 'Directional Twin', '', 'Hybrid Camber', 'Fusion Camber', 'SuperPop Core Matrix', '', '', 'Carbon Single Barrel ~ 45/90 Hybrid Laminate ~ GlassPack Impact Plates', '', 'SinterSpeed Base', '', '', '', 'SinterStrong Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-16 00:39:00', '2024-04-16 00:39:00'),
(173, '', 'Rome', 'Blur', '2020', 'Rome Blur 2020', 'rome-blur-2020', 'Snowboard', '', 'The Blur is the choice when you want a technical board that can ride the mountain with speed, quickness and power.The three-way combination of our Fusion camber, a solid dose of sidecut and our Dual Arc Turborods creates a distinctly responsive feel that lets you lay deep ruts and quickly pop from edge to edge.', 7, 'Directional', '', 'Hybrid Camber', 'Fusion Camber', 'AirPop Core Matrix', '', 'Biax', 'TurboRods ~ 45/90 Hybrid Laminate ~ GlassPack Impact Plates', '', 'SinterTrue Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-16 00:45:29', '2024-04-16 00:45:29'),
(174, '', 'Rome', 'Mountain Division', '2020', 'Rome Mountain Division 2020', 'rome-mountain-division-2020', 'Snowboard', '', 'Downhill slaughterhouse runs. Nose deep pow sessions. Late afternoon mach speed busting through a layer of Skippy extra chunky coating the lower mountain. Stomping landings with more icing than the winner of Cake Boss. If you need a board to handle all of these situation and having you riding out with an ear to ear grin every time, the Rome Mountain Division Snowboard is your ticket to glory. Directional, powerful, and nimble all at once, there`s not much a hard charging rider can`t do with this beast.', 8, 'Directional', '', 'Directional Camber', 'Free-the-Ride Camber', 'AirPop Core Matrix', '', 'Biax', 'TurboRods ~ 45/90 Hybrid Laminate ~ GlassPack Impact Plates', '', 'SinterSpeed Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-16 00:48:59', '2024-04-16 00:48:59'),
(175, '', 'Rome', 'Winterland', '2020', 'Rome Winterland 2020', 'rome-winterland-2020', 'Snowboard', '', 'The Rome Winterland Snowboard is the all-mountain powder hound hybrid you`ve been looking for. Its versatile, directional shape integrates three distinct rocker zones - a rockered nose transitions into a flat section under your front foot, with positive camber back to the tail, great for handling steeps, deeps, or tracked out mush. With a medium-firm flex, this board is perfect for taking on variable conditions at speed and still being able to play around on sidehits when you want to take it easy. Ride fast, ride free with the super capable Rome Winterland Snowboard.', 6, 'Directional', '', 'Directional Camber', 'Free-the-Ride Camber', 'SuperPop Core Matrix', '', 'Biax', 'Carbon Double Barrel TurboRods ~ 45/90 Hybrid Laminate', '', 'SinterTrue Base', '', '', '', '', '4x2', 0, 0, 1, 0, '2024-04-16 00:50:21', '2024-04-16 00:50:21'),
(176, '', 'Rome', 'Powder Division', '2020', 'Rome Powder Division 2020', 'rome-powder-division-2020', 'Snowboard', '', 'There`s a change in the air. You can sense something amiss. You grab your Rome Powder Division MT Snowboard and head to the window to check. Yes, it`s pow, and you`ve made the right choice for the steed of the day. Its 3D-rockered nose surfs the mountain like a billionaire`s yacht through protected seas, while the bi-radial sidecut of the Rome Powder Division MT Snowboard maintains a nimble and precise feeling despite the width. Exotic carbon laminates help you keep the power down and stable during epic lines, which you will undoubtedly want to seek out after picking up a clutch beast like this mean pow-hungry machine.', 7, 'Directional', '', 'Directional Camber', 'Powder-S 3D Camber', 'Pop Core Matrix', '', 'Biax', 'Straight Biax Carbon Laminate ~ Carbon Single Barrel', '', 'SinterTrue Base', '', '', '', 'SinterStrong Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-16 00:52:58', '2024-04-16 00:52:58'),
(177, '', 'Rome', 'Powder Division Split', '2020', 'Rome Powder Division Split 2020', 'rome-powder-division-split-2020', 'Splitboard', '', 'Born and bred to ride through a powdery range of backcountry terrain, the Rome Powder Division Moon Tail Splitboard has a shorter length and wider width to keep things agile in tight spots. Crafted with a surfy Powder-S 3D profile, this board is focused on powder, and powder only. The rockered nose is contoured like a surfboard for superior glide and a highly maneuverable feel, and camber underfoot maintains edge control when you run into tracked-out slopes.', 7, 'Directional', '', 'Directional Camber', 'Powder-S 3D Camber', 'Pop Core Matrix', '', 'Biax', 'Straight Biax Carbon Laminate ~ Carbon Single Barrel', '', 'SinterTrue Base', '', '', '', 'SinterStrong Sidewalls', 'Voil Insert Pattern', 0, 0, 0, 0, '2024-04-16 01:00:43', '2024-04-16 01:00:43'),
(178, '', 'Rome', 'Whiteroom Split', '2020', 'Rome Whiteroom Split 2020', 'rome-whiteroom-split-2020', 'Splitboard', '', 'Resort riding is amazing, but snowboarding is expanding more and more away from the crowds and patrolled control of lift-accessed terrain. Our Whiteroom is built on a design package that optimizes float and powder carving, with the power to snap off a lip and throw clouds.', 7, 'Directional', '', 'Directional Camber', 'Powder-S 3D Camber', 'AirPop Core Matrix', '', '', '45/90 Hybrid Laminate ~ Carbon Double Barrel HotRods', '', 'SinterSpeed Base', '', '', '', 'SinterStrong Sidewalls', 'Voil Insert Pattern', 0, 0, 0, 0, '2024-04-16 01:05:15', '2024-04-16 01:05:15'),
(179, '', 'Rome', 'Powderroom Split', '2020', 'Rome Powderroom Split 2020', 'rome-powderroom-split-2020', 'Splitboard', '', 'Classic shape with rocker and camber underfoot for the ladies that rip hard. The Powder Room is the perfect choice for any kind of terrain. A board that requires to be pressed hard to squeeze out the most of it, but its easy to ride thanks a nice balance between flex and torsion.', 6, 'Directional', '', 'Directional Camber', 'Powder-S 3D Camber', 'AirPop Core Matrix', '', '', '45/90 Hybrid Laminate ~ Carbon Double Barrel HotRods', '', 'SinterSpeed Base', '', '', '', 'SinterStrong Sidewalls', 'Voil Insert Pattern', 0, 0, 1, 0, '2024-04-16 01:08:08', '2024-04-16 01:08:08'),
(180, '', 'Rome', 'Lo-Fi', '2020', 'Rome Lo-Fi 2020', 'rome-lo-fi-2020', 'Snowboard', '', 'Shop all RomeThe Rome Lo-Fi Snowboard is an all-mountain experience extraordinaire for the everyday rider. The camber profile gives you plenty of pop under the bindings with a bit of rocker in the tip and tail to help you get loose when the snow stacks up, and the directional shape invites playful riding on the whole mountain. The board is smooth and predictable, inspiring confidence on any terrain for a wide variety of riders.', 6, 'Directional Twin', '', 'Hybrid Camber', 'Fusion Camber', 'Pop Core Matrix', '', 'Biax', 'Bamboo Single Barrel Pattern', '', 'SinterTrue Base', '', '', '', '', '4x2', 0, 0, 1, 0, '2024-04-16 01:11:06', '2024-04-16 01:11:06'),
(181, '', 'Rome', 'Degenerati Model 1', '2020', 'Rome Degenerati Model 1 2020', 'rome-degenerati-model-1-2020', 'Snowboard', '', 'Kiss financial stability goodbye, `cause you`ve got the fever`. The only cure is a combination of surfing couches, smoking your lunch, travelling by van and putting snowbarding above all else. Our doctor, Mantis Toboggan, also recommends a healthy dose of Model 1. This flat cambered, negative energy counteracting, jib-oriented offering is perfect for those who have committed to a life in The Void: pushing the boundaries of what can be ridden, while simultaneously offending everyone at Denny`s', 6, 'Directional Twin', '', 'Flat Camber', 'Contact Camber', 'Pop Core Matrix', '', 'Biax', 'HiBeam Tech: Void Pack ~ StraightBox Laminate', '', 'SinterTrue Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-18 16:09:18', '2024-04-18 16:09:18'),
(182, '', 'Rome', 'Warden', '2020', 'Rome Warden 2020', 'rome-warden-2020', 'Snowboard', '', 'Send your boring board to The Hague. The Rome Warden Snowboard rips groomers, polices the tree runs, and liberates you from the cruelty of having to pay for the privilege to rely on someone else`s beat-up rental junk. Lay down a mean euro, play in a secret pow stash and slash your way down the hill with authori-tah. The Rome Warden Snowboard hates to be confined and loves to get after it day after day thanks to its durable extruded base and bamboo stringer construction.', 4, 'Directional Twin', '', 'Hybrid Camber', 'Fusion Camber', 'Pop Core Matrix', '', 'Biax', 'Duel Bamboo Stringers ~ StraightBox Laminate', '', 'XTRD Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-18 16:13:17', '2024-04-18 16:13:17'),
(183, '', 'Rome', 'Mod', '2020', 'Rome Mod 2020', 'rome-mod-2020', 'Snowboard', '', 'Power, precision and more pop than a middle school dance party, the Mod is the go-to for team riders like Stle and Rene. Dont kid yourself, this isnt just a contest board; the Mod is equally at home boosting side hits and snapping ollies over entire resort villages. As a true cambered board, the Mod holds an edge and really just wants you to point it at whatevers below.', 8, 'Twin', '', 'Full Camber', 'Stay Positive Camber', 'AirPop Superlight Core Matrix', '', 'Biax', 'Carbon Reverse Radial V ~ GlassPack Impact Plates', '', 'SinterCarbon Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-24 23:48:56', '2024-04-24 23:48:56'),
(184, '', 'Rome', 'Buckshot', '2020', 'Rome Buckshot 2020', 'rome-buckshot-2020', 'Snowboard', '', 'Ozzy Henning`s jib everything park machine takes the age old concept of a fully cambered park board to it`s logical conclusion. Without straying from the traditional twin shape that will never not be fun to ride, the Rome Buckshot Snowboard amps up everything with a spring loaded construction that`s ready to unleash more bounce than a overturned semi outside the bouncy ball factory. We`re talking springy little bits of rubber just zinging around everywhere, same as you`re going to be when you strap this board on your feet and pop, pounce, punt, and pivot past everything in the dang park.', 5, 'Twin', '', 'Full Camber', 'Stay Positive Camber', 'Pop Core Matrix', '', 'Biax', 'Bamboo Single Barrel ~ GlassPack Impact Plates ~ StraightBiax Carbon Laminate', '', 'SinterTrue Base', 'Impact Edges', '', '', 'Rebound Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-24 23:53:38', '2024-04-24 23:53:38'),
(185, '', 'Rome', 'Gangplank', '2020', 'Rome Gangplank 2020', 'rome-gangplank-2020', 'Snowboard', '', 'Ahoy, transition rider. The Rome Gang Plank Snowboard is made for the sidehit-with-style crowd, a freestyle and all-mountain freak show that somehow manages to float, pop, flex, and rip all at the same time. It`s even pressable with buttery goodness for park days or for killing time while waiting for your slower friends to hurry up and strap in. With the Rome Gang Plank Snowboard, you`re in your board`s element everywhere on the mountain, even rocketing through the air above it.', 6, 'Twin', '', 'Hybrid Flat', 'Contact Rocker', 'Pop Core Matrix', '', 'Biax', 'Bamboo Single Barrel ~ GlassPack Impact Plates ~ StraightBiax Laminate', '', 'SinterTrue Base', '', '', '', 'Rebound Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-25 00:02:10', '2024-04-25 00:02:10');
INSERT INTO `SkiBoards` (`skiboard_id`, `url`, `brand`, `model`, `year`, `name`, `slug`, `category`, `family`, `description`, `stiffness`, `shape`, `flex_profile`, `camber_profile`, `camber_details`, `core`, `core_profiling`, `fibreglass`, `laminates`, `resin`, `base`, `edges`, `edge_tech`, `topsheet`, `sidewall`, `inserts`, `asym`, `weight`, `womens`, `youth`, `created`, `updated`) VALUES
(186, '', 'Rome', 'Agent', '2020', 'Rome Agent 2020', 'rome-agent-2020', 'Snowboard', '', 'Shaken, stirred, whatever. The Rome Agent Snowboard doesn`t mince words or waffle on minor decisions, it just sends, shreds, rips, dips, boosts, and gets all-around jiggy with it. Its Fusion Camber loves to get loaded up for fun in the park and hucking off whatever looks like a good ramp, with gentle rocker in the nose and tail to bring smoothness and playfulness to a versatile all-mountain sled. A speedy sintered base under a bamboo and carbon boosted core means you can enjoy full-throttle thrills on any terrain worthy of your sliding.', 5, 'Twin', '', 'Hybrid Camber', 'Fusion Camber', 'Pop Core Matrix', '', 'Biax', 'Bamboo Single Barrel ~ GlassPack Impact Plates ~ StraightBiax Carbon Laminate', '', 'SinterTrue Base', '', '', '', 'Rebound Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-25 00:04:56', '2024-04-25 00:04:56'),
(187, '', 'Rome', 'Artifact', '2020', 'Rome Artifact 2020', 'rome-artifact-2020', 'Snowboard', '', 'Park boarders gotta eat, and that means they need a board that loves to tango through heaps of snowy leaps from summit to park. The Rome Artifact Snowboard goes way back, but Rome likes to keep things spicy. Taking cues from the skate industry, this playful park board is made to thrive in creative terrain so you can trick, jib, and just plain get silly on lap after lap. Rebound Sidewalls give you a little more play from your edges so your board can take a beating and live to keep up the good fight.', 4, 'Twin', '', 'Hybrid Flat', 'Contact Rocker', 'Stomp Core', 'Skatecore Profiling', 'Biax', 'GlassPack Impact Plates ~ Straight Edge HighBeam', '', 'Impact Base', '', '', '', 'Rebound Sidewalls', '4x2', 0, 0, 0, 0, '2024-04-27 03:33:44', '2024-04-27 03:33:44'),
(188, '', 'Rome', 'Degenerati Model 2', '2020', 'Rome Degenerati Model 2 2020', 'rome-degenerati-model-2-2020', 'Snowboard', '', 'Fear not weary traveler, for this is the end of the feed. Youre all caught up. Hidden somewhere in the sequence of zeros and ones, lies an unalienable truth  snowboarding is all that matters. Be advised, Model 2 is not for the faint of heart; please consult your doctor before riding Model 2 if youve experienced loss of breath, weakness of flex, lack of camber, false prophets, bleeding of gums or general apathy towards snowboarding. For best results, please ride Model 2 only with all the homies under the cover of darkness.', 4, 'Twin', '', 'Full Camber', 'Stay Positive Camber', 'TTT Core Matrix', '', 'Biax', 'HighBeam Configuration LoudPack', '', 'Impact Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-27 03:47:14', '2024-04-27 03:47:14'),
(189, '', 'Rome', 'Blackjack', '2020', 'Rome Blackjack 2020', 'rome-blackjack-2020', 'Snowboard', '', 'They say you shouldn`t count your money when you`re sittin` at the table. But you can definitely count on that nose press being money when you`re sliding the Rome Blackjack Snowboard across the tabletop. With a flat Contact Camber profile and FiveGnar multi-radius sidecut for the best in pressability, edge hold, and stability, the Blackjack is as close to a sure thing as you`re going to get, and you can bet on that.', 5, 'Twin', '', 'Flat Camber', 'Contact Camber', 'Pop Core Matrix', '', 'Biax', 'Bamboo Single Barrel HotRod ~ StraightBiax Carbon Laminate', '', 'Impact Base', '', '', '', '', '4x2', 0, 0, 0, 0, '2024-04-27 03:56:01', '2024-04-27 03:56:01'),
(190, '', 'Rome', 'Heist', '2020', 'Rome Heist 2020', 'rome-heist-2020', 'Snowboard', '', 'From powder indulgences to high-speed debauchery, the Rome Heist Snowboard is all about stealing the mountain swells. It`s made with a sophisticated blend of camber and rocker points making it ideal for exploring all varieties of terrain while staying nimble and stable. A more aggressive flex pairs with the QuickRip Sidecut and makes this board smooth and comfortable, but responsive so you can dodge ski patrol.', 4, 'Twin', '', 'Hybrid Camber', 'Fusion Camber', 'Pop Core Matrix', '', 'Biax', 'Bamboo Single Barrel HotRod ~ StraightBiax Carbon Laminate', '', 'SinterTrue Base', '', '', '', '', '4x2', 0, 0, 1, 0, '2024-04-27 04:07:46', '2024-04-27 04:07:46'),
(191, '', 'Rome', 'Kashmir', '2020', 'Rome Kashmir 2020', 'rome-kashmir-2020', 'Snowboard', '', 'Strapping into this board is like wrapping up your riding style in a super soft and comfy sweater and letting it lose to play where it wants. The Rome Kashmir Snowboard has a mid-soft flex that`s perfect for the park, and a buttery smooth style that`ll have you feeling good around the rest of the mountain too. The flat camber is precise and pressable, built to fit around rails and flat boxes like a well-knit mitten. Feel the luxurious comfort of Kashmir, and never look back.', 5, 'Twin', '', 'Flat Camber', 'Contact Camber', 'Pop Core Matrix', '', 'Biax', 'Glass Single Barrel HotRod ~ StraightBiax Carbon Laminate', '', 'Impact Base', '', '', '', '', '4x2', 0, 0, 1, 0, '2024-04-27 04:09:59', '2024-04-27 04:09:59'),
(192, '', 'Rome', 'Royal', '2020', 'Rome Royal 2020', 'rome-royal-2020', 'Snowboard', '', 'Hear ye, hear ye. The Rome Royal Snowboard is a regal sideways-sliding companion for the progressing rider all the way up to the well-seasoned veteran shredder. It`s made with a contact rocker profile which has a looser, more playful feel which keeps your edges up and free from catching. With a QuickRip Sidecut and a slick and durable extruded base, the Rome Royal Snowboard offers up a buttery smooth ride that`s perfect for every nook of the mountain.', 3, 'Twin', '', 'Hybrid Flat', 'Contact Rocker', 'TTT Core Matrix', '', 'Biax', 'Glass Single Barrel HotRod ~ StraightBiax Carbon Laminate', '', 'XTRD Base', '', '', '', '', '4x2', 0, 0, 1, 0, '2024-04-27 04:14:23', '2024-04-27 04:14:23'),
(193, '', 'K2', 'Standard', '2020', 'K2 Standard 2020', 'k2-standard-2020', 'Snowboard', '', 'The K2 Standard Snowboard is the choice board for those just getting their footing, or intermediate riders looking to push their skills on a forgiving and playful deck. It`s made with a Catch-Free Rocker Baseline that moves the contact points off the snow for an intuitive and easy-going ride. Combined with a soft flex and snappy aspen wood core, the K2 Standard Snowboard sets the benchmark of having fun sliding on snow.', 2, 'Directional Twin', '', 'Hybrid Flat', '', 'Aspen Core', '', 'Biax Glass', '', '', 'Extruded 2000 Base', '', '', '', 'Hybritech', '4x2', 0, 0, 0, 0, '2024-04-27 05:12:50', '2024-04-27 05:12:50'),
(194, '', 'K2', 'First Lite', '2020', 'K2 First Lite 2020', 'k2-first-lite-2020', 'Snowboard', '', 'The K2 First Lite Snowboard hits the sweet spot for beginner and intermediate riders looking to improve rapidly. Shaped for predictability, this board`s easy to ride profile is fun and forgiving, the Catch-Free Rocker Baseline making it one of the progression-friendly boards on the market. With a softer flex and extruded base, this board`s chill ride is great for making the most out of your all-mountain escapades.', 4, 'Twin', '', 'Hybrid Flat', '', 'Aspen Core', '', 'Biax Glass', '', '', 'Extruded 2000 Base', '', '', '', '', '4x2', 0, 0, 1, 0, '2024-04-27 05:14:19', '2024-04-27 05:14:19'),
(195, '', 'K2', 'Bright Lite', '2020', 'K2 Bright Lite 2020', 'k2-bright-lite-2020', 'Snowboard', '', 'A beacon of all-mountain progression, the K2 Bright Lite Snowboard`s Directional Rocker Baseline makes navigating the entire mountain easy with its mellow rocker and catch-free tip and tail. The softer flexing women`s specific Rhythm Core is forgiving and playful, making the Bright Lite a fantastic board for up and coming riders who want to discover the entirety of their playground.', 4, 'Directional Twin', '', 'Hybrid Flat', '', 'Rhythm Core', '', 'Biax Glass', '', '', 'Extruded 2000 Base', '', '', '', 'Hybritech', '4x2', 0, 0, 1, 0, '2024-04-27 05:22:55', '2024-04-27 05:22:55'),
(196, '', 'K2', 'WWW', '2020', 'K2 Www 2020', 'k2-www-2020', 'Snowboard', '', 'The K2 WWW Snowboard is a tried and true freestyle board that lays the smackdown in the park like John Cena on Monday Night Raw. Equipped with a durable extruded base that`s tough enough to take on The Rock in a cage match, yet smooth like Stone Cold`s head, the WWW`s new, updated Twin Camber Baseline makes it more versatile without sacrificing it`s legendary freestyle chops.', 4, 'Twin', '', 'Hybrid Camber', '', 'Aspen Core', '', 'Biax Glass', '', '', 'Extruded 2000 Base', '', '', 'P-Tex Topsheet', 'Hybritech', '4x2', 0, 0, 0, 0, '2024-04-27 05:30:03', '2024-04-27 05:30:03'),
(197, '', 'K2', 'Party Platter', '2020', 'K2 Party Platter 2020', 'k2-party-platter-2020', 'Snowboard', '', 'Butter, dive, or just get a little sendy -- no matter what you get into with the K2 Party Platter Snowboard, you`re in for a good time. Featuring a Directional Rocker Baseline and Tweekend tips for added surface area, this board is the perfect companion for all-terrain freeride, showcasing K2`s continued refinement of their Volume Shift approach. With a grip of new sizes available this season, the K2 Party Platter Snowboard is one helluva snowboard available to just about any rider. For best results, size down from your standard board.', 4, 'Directional', '', 'Directional Hybrid Flat', '', 'BAP Core', '', 'Biax Glass', 'Ollie Bar', '', 'Sintered 4000 Base', '', '', '', 'Hybritech', '4x2', 0, 0, 0, 0, '2024-04-27 05:39:05', '2024-04-27 05:39:05'),
(198, '', 'K2', 'Bottle Rocket', '2020', 'K2 Bottle Rocket 2020', 'k2-bottle-rocket-2020', 'Snowboard', '', 'Throwin` down some radical `80s goodness to your ride, the K2 Bottle Rocket Snowboard is all about making sure you have a rip-roarin` good time wherever you take `er. Featuring a Twin Rocker Baseline, this board`s predictable ride is responsive and has carbon stingers to give it a snappy and lively feel. Built on a mid-wide outline with a long sidecut radius, this board is a favorite for street missions, park laps, and slushy summer days on the glacier.', 6, 'Twin', '', 'Directional Hybrid Flat', '', 'BAP Core', '', 'Triax Glass', 'ICG Carbon Glass ~ Carbon Torque Forks', '', 'Sintered 4000 Base', '', '', 'P-Tex Topsheet', 'Hybritech', '4x2', 0, 0, 0, 0, '2024-04-27 05:41:25', '2024-04-27 05:41:25'),
(199, '', 'K2', 'Lime Lite', '2020', 'K2 Lime Lite 2020', 'k2-lime-lite-2020', 'Snowboard', '', 'If you spend your days looking for every lip, knuckle, and hidden jib you can find -- then the K2 Lime Lite Snowboard is definitely for you. Designed for the ladies who treat the mountain like a playground, this true twin just wants to have fun. Carbon Torque Forks and solid camber underfoot make this board poppy and responsive, with rockered tips for easy pivot in the soft stuff.', 4, 'Directional Twin', '', 'Hybrid Camber', '', 'Rhythm Core', '', 'Biax Glass', 'Carbon Torque Forks', '', 'Sintered 4000 Base', '', '', 'P-Tex Topsheet', 'Hybritech', '4x2', 0, 0, 1, 0, '2024-04-27 05:43:12', '2024-04-27 05:43:12'),
(200, '', 'K2', 'Medium', '2020', 'K2 Medium 2020', 'k2-medium-2020', 'Snowboard', '', 'Go hard, or go medium - with the K2 Medium Snowboard. An all-new board designed around the needs of K2 pro Jake Kuzyk, the Medium is snappy yet forgiving, floaty yet tenacious over hardpack. It`s the do it all board Jake needs for his all-terrain, top to bottom freestyle needs, an all-mountain dreamboat that lives to have fun from pow to park and everywhere in between!', 6, 'Twin', '', 'Hybrid Camber', '', 'BAP Core', '', 'Triax Glass', 'Carbon DarkWeb ~ Ollie Bar', '', 'Sintered 4000 Base', '', '', 'Inked Glass Topsheet', 'Hybritech', '4x2', 0, 0, 0, 0, '2024-04-27 05:55:34', '2024-04-27 05:55:34'),
(201, '', 'K2', 'Afterblack', '2020', 'K2 Afterblack 2020', 'k2-afterblack-2020', 'Snowboard', '', 'Park rats beware, the K2 Afterblack Snowboard is on the prowl! This playful board feels just as comfortable pressing a rail as it does hucking itself off the biggest jump on the XL line. The prime choice for the K2 team and just about anyone who`s interested in pushing the freestyle envelope, this board`s buttery soft flex and Combination Camber Baseline give you all the float and precision you need to get rowdy.', 5, 'Twin', '', 'Hybrid Camber', '', 'BAP Core', '', 'Triax Glass', 'Carbon DarkWeb', '', 'Sintered 4000 Base', '', '', '', 'Hybritech', '4x2', 0, 0, 0, 0, '2024-04-27 05:57:16', '2024-04-27 05:57:16');
